acteres}}.\";'),('pt','messages:passwordtoopopular','s:113:\"Palavras-passe normalmente escolhidas não podem ser usadas. Por favor, escolha uma palavra-passe mais exclusiva.\";'),('pt','messages:password-name-match','s:67:\"A sua palavra-passe tem de ser diferente do seu nome de utilizador.\";'),('pt','messages:password-login-forbidden','s:60:\"Foi proibido o uso deste nome de utilizador e palavra-passe.\";'),('pt','messages:mailmypassword','s:25:\"Reiniciar a palavra-passe\";'),('pt','messages:passwordremindertitle','s:46:\"Nova palavra-passe temporária na {{SITENAME}}\";'),('pt','messages:passwordremindertext','s:546:\"Alguém (provavelmente você, a partir do endereço IP $1) solicitou uma palavra-passe nova para a sua conta na {{SITENAME}} ($4).\nFoi criada a palavra-passe temporária \"$3\" para o utilizador \"$2\".\nSe o pedido foi feito por si, entre agora na sua conta e escolha uma palavra-passe nova.\nA palavra-passe temporária expira após {{PLURAL:$5|um dia|$5 dias}}.\n\nCaso outra pessoa tenha feito o pedido, ou se entretanto se recordou da sua palavra-passe e já não deseja alterá-la, ignore esta mensagem e continue a utilizar a palavra-passe antiga.\";'),('pt','messages:noemail','s:78:\"Não foi registado um endereço de correio eletrónico para o utilizador \"$1\".\";'),('pt','messages:noemailcreate','s:60:\"Tem de fornecer um endereço de correio eletrónico válido.\";'),('pt','messages:passwordsent','s:147:\"Foi enviada uma palavra-passe nova para o endereço de correio eletrónico do utilizador \"$1\".\nVolte a iniciar sessão após recebê-la, por favor.\";'),('pt','messages:blocked-mailpassword','s:165:\"O seu endereço IP está bloqueado para edição. Para evitar abusos, não é permitido a utilização da recuperação de palavra-passe a partir deste endereço IP.\";'),('pt','messages:eauthentsent','s:258:\"Foi enviada uma mensagem de confirmação para o endereço de correio eletrónico que especificou.\nAntes que seja enviada qualquer outra mensagem para a conta, terá de seguir as instruções na mensagem enviada, de modo a confirmar que a conta lhe pertence.\";'),('pt','messages:throttled-mailpassword','s:233:\"Já foi enviada um email de recuperação de palavra-passe {{PLURAL:$1|na última hora|nas últimas $1 horas}}.\nPara prevenir abusos, só um email de recuperação de palavra-passe pode ser enviado a cada {{PLURAL:$1|hora|$1 horas}}.\";'),('pt','messages:mailerror','s:39:\"Erro ao enviar correio electrónico: $1\";'),('pt','messages:acct_creation_throttle_hit','s:273:\"Visitantes desta wiki com endereço IP igual ao seu criaram {{PLURAL:$1|uma conta|$1 contas}} nos últimos (ou últimas) $2, o que é o máximo permitido neste período de tempo.\nEm resultado, visitantes com este endereço IP não podem criar mais nenhuma conta de momento.\";'),('pt','messages:emailauthenticated','s:67:\"O seu endereço de correio eletrónico foi confirmado a $2, às $3.\";'),('pt','messages:emailnotauthenticated','s:143:\"O seu endereço de correio eletrónico ainda não foi confirmado.\nNão lhe serão enviadas mensagens por nenhuma das seguintes funcionalidades.\";'),('pt','messages:noemailprefs','s:105:\"Especifique um endereço de correio eletrónico nas suas preferências para ativar estas funcionalidades.\";'),('pt','messages:emailconfirmlink','s:47:\"Confirme o seu endereço de correio eletrónico\";'),('pt','messages:invalidemailaddress','s:165:\"O endereço de correio eletrónico não pode ser aceite porque parece ter um formato inválido.\nIntroduza um endereço formatado corretamente ou deixe o campo vazio.\";'),('pt','messages:cannotchangeemail','s:84:\"Os endereços de correio eletrónico das contas não podem ser alterados nesta wiki.\";'),('pt','messages:emaildisabled','s:66:\"Este sítio não consegue enviar mensagens de correio eletrónico.\";'),('pt','messages:accountcreated','s:12:\"Conta criada\";'),('pt','messages:accountcreatedtext','s:91:\"A conta de utilizador para [[{{ns:User}}:$1|$1]] ([[{{ns:User talk}}:$1|talk]]) foi criada.\";'),('pt','messages:createaccount-title','s:34:\"Criação de conta na {{SITENAME}}\";'),('pt','messages:createaccount-text','s:256:\"Alguém criou uma conta com o nome $2 para o seu endereço de correio eletrónico, na wiki {{SITENAME}} ($4), com a palavra-passe \"$3\".\nDeve agora iniciar sessão e alterar a sua palavra-passe.\n\nSe a conta foi criada por engano, pode ignorar esta mensagem.\";'),('pt','messages:login-throttled','s:117:\"Realizou demasiadas tentativas de início de sessão com esta conta.\nAguarde $1 antes de tentar novamente, por favor.\";'),('pt','messages:login-abort-generic','s:39:\"O início de sessão falhou - Cancelado\";'),('pt','messages:login-migrated-generic','s:78:\"A sua conta foi migrada e o seu nome de utilizador já não existe nesta wiki.\";'),('pt','messages:loginlanguagelabel','s:10:\"Idioma: $1\";'),('pt','messages:suspicious-userlogout','s:119:\"O seu pedido para sair foi negado porque parece ter sido enviado por um navegador danificado ou por um proxy com cache.\";'),('pt','messages:createacct-another-realname-tip','s:137:\"O fornecimento do nome verdadeiro é opcional.\nSe optar por revelá-lo, ele será utilizado para atribuir-lhe crédito pelo seu trabalho.\";'),('pt','messages:pt-login','s:6:\"Entrar\";'),('pt','messages:pt-login-button','s:6:\"Entrar\";'),('pt','messages:pt-login-continue-button','s:30:\"Continuar o início de sessão\";'),('pt','messages:pt-createaccount','s:15:\"Criar uma conta\";'),('pt','messages:pt-userlogout','s:4:\"Sair\";'),('pt','messages:php-mail-error-unknown','s:43:\"Erro desconhecido na função mail() do PHP\";'),('pt','messages:user-mail-no-addy','s:67:\"Tentou enviar uma mensagem sem um endereço de correio eletrónico.\";'),('pt','messages:user-mail-no-body','s:79:\"Tentou enviar uma mensagem sem conteúdo ou com um conteúdo demasiado pequeno.\";'),('pt','messages:changepassword','s:21:\"Alterar palavra-passe\";'),('pt','messages:resetpass_announce','s:71:\"Para completar a autenticação, tem de definir uma palavra-passe nova.\";'),('pt','m