ar\";'),('pt','messages:botpasswords-label-delete','s:8:\"Eliminar\";'),('pt','messages:botpasswords-label-resetpassword','s:23:\"Redefinir palavra-passe\";'),('pt','messages:botpasswords-label-grants','s:26:\"Atribuições aplicáveis:\";'),('pt','messages:botpasswords-help-grants','s:175:\"Cada atribuição dá acesso às permissões listadas que uma conta de utilizador já possua. Consulte a [[Special:ListGrants|tabela de atribuições]] para mais informação.\";'),('pt','messages:botpasswords-label-grants-column','s:9:\"Concedido\";'),('pt','messages:botpasswords-bad-appid','s:37:\"O nome do robô \"$1\" não é válido.\";'),('pt','messages:botpasswords-insert-failed','s:61:\"Falhou ao adicionar o nome do robô \"$1\". Já foi adicionado?\";'),('pt','messages:botpasswords-update-failed','s:65:\"Falha ao atualizar o nome do robô \"$1\". Será que foi eliminado?\";'),('pt','messages:botpasswords-created-title','s:33:\"Criada palavra-passe para o robô\";'),('pt','messages:botpasswords-created-body','s:73:\"A palavra-passe de robô para o robô \"$1\" do utilizador \"$2\" foi criada.\";'),('pt','messages:botpasswords-updated-title','s:40:\"A palavra-passe de robô foi atualizada.\";'),('pt','messages:botpasswords-updated-body','s:82:\"O robô palavra-passe para o nome do robô \"$1\" do utilizador \"$2\" foi atualizado.\";'),('pt','messages:botpasswords-deleted-title','s:32:\"Palavra-passe de robô eliminada\";'),('pt','messages:botpasswords-deleted-body','s:80:\"O robô palavra-passe para o nome do robô \"$1\"do utilizador \"$2\" foi eliminado.\";'),('pt','messages:botpasswords-newpassword','s:338:\"A nova palavra-passe para iniciar sessão com <strong>$1</strong> é <strong>$2</strong>. <em>Anote-a para referência futura, por favor.</em> <br> (Para robôs antigos cujo nome de acesso tenha de ser igual ao eventual nome de utilizador, também pode usar o nome de utilizador <strong>$3</strong> e a palavra-passe <strong>$4</strong>.)\";'),('pt','messages:botpasswords-no-provider','s:51:\"BotPasswordsSessionProvider não está disponível.\";'),('pt','messages:botpasswords-restriction-failed','s:66:\"Restrições de palavra-passe de robô evitam esta autenticação.\";'),('pt','messages:botpasswords-invalid-name','s:92:\"O nome de utilizador especificado não contém o separador de palavra-passe de robô (\"$1\").\";'),('pt','messages:botpasswords-not-exist','s:62:\"O utilizador \"$1\" não possui uma palavra-passe de robô \"$2\".\";'),('pt','messages:resetpass_forbidden','s:40:\"Não é possível alterar palavras-passe\";'),('pt','messages:resetpass_forbidden-reason','s:46:\"As palavras-passe não podem ser alteradas: $1\";'),('pt','messages:resetpass-no-info','s:66:\"Precisa de iniciar sessão para aceder diretamente a esta página.\";'),('pt','messages:resetpass-submit-loggedin','s:21:\"Alterar palavra-passe\";'),('pt','messages:resetpass-submit-cancel','s:8:\"Cancelar\";'),('pt','messages:resetpass-wrong-oldpass','s:137:\"Palavra-passe temporária ou atual inválida.\nPode ter já alterado a sua palavra-passe ou solicitado uma nova palavra-passe temporária.\";'),('pt','messages:resetpass-recycled','s:68:\"Redefina a sua palavra-passe para uma diferente da atual, por favor.\";'),('pt','messages:resetpass-temp-emailed','s:122:\"Iniciou a sessão com um código temporário.\nPara completar a autenticação, tem de definir uma palavra-passe nova aqui:\";'),('pt','messages:resetpass-temp-password','s:26:\"Palavra-passe temporária:\";'),('pt','messages:resetpass-abort-generic','s:63:\"A alteração da palavra-passe foi cancelada por uma extensão.\";'),('pt','messages:resetpass-expired','s:79:\"A sua palavra-passe expirou. Por favor, defina uma nova para iniciar a sessão.\";'),('pt','messages:resetpass-expired-soft','s:158:\"A sua palavra-passe expirou e tem de ser redefinida. Escolha uma nova agora ou clique \"{{int:authprovider-resetpass-skip-label}}\" para redefini-la mais tarde.\";'),('pt','messages:resetpass-validity-soft','s:175:\"A sua palavra-passe não é válida: $1\n\nPor favor, escolha uma nova palavra-passe agora, ou clique em \"{{int:authprovider-resetpass-skip-label}}\" para redefini-la mais tarde.\";'),('pt','messages:passwordreset','s:23:\"Redefinir palavra-passe\";'),('pt','messages:passwordreset-text-one','s:93:\"Preencha este formulário para receber uma palavra-passe temporária por correio eletrónico.\";'),('pt','messages:passwordreset-text-many','s:104:\"{{PLURAL:$1|Preencha um dos campos para receber uma palavra-passe temporária por correio eletrónico.}}\";'),('pt','messages:passwordreset-disabled','s:64:\"A redefinição da palavra-passe foi impossibilitada nesta wiki.\";'),('pt','messages:passwordreset-emaildisabled','s:66:\"A funcionalidade de correio eletrónico foi desativada nesta wiki.\";'),('pt','messages:passwordreset-username','s:22:\"Nome de utilizador(a):\";'),('pt','messages:passwordreset-domain','s:9:\"Domínio:\";'),('pt','messages:passwordreset-capture','s:26:\"Ver a mensagem resultante?\";'),('pt','messages:passwordreset-capture-help','s:111:\"Se marcar esta caixa, a mensagem (com a palavra-passe temporária) ser-lhe-á mostrada e enviada ao utilizador.\";'),('pt','messages:passwordreset-email','s:20:\"Correio eletrónico:\";'),('pt','messages:passwordreset-emailtitle','s:33:\"Detalhes da conta na {{SITENAME}}\";'),('pt','messages:passwordreset-emailtext-ip','s:664:\"Alguém (provavelmente você, a partir do endereço IP $1) pediu a recuperação da palavra-passe no projeto {{SITENAME}} ($4). {{PLURAL:$3|A seguinte conta de utilizador está associada|As seguintes contas de utilizador estão associadas}} a este correio eletrónico:\n\n$2\n\n{{PLURAL:$3|Esta palavra-passe temporária irá|Estas palavras-passes temporárias irão}} expirar dentro de {{PLURAL:$5|um dia|$5 dias}}.\nDeve autenticar-se e escolher uma palavra-passe nova agora. Se outra pessoa fez este pedido, ou se entretanto se recordou da sua palavra-passe original e já não deseja alterá-la, pode ignorar esta mensagem e continuar a usar a palavra-passe antiga.\";'),('pt','messages:passwordreset-emailtext-user','s:662:\"O utilizador $1 do projeto {{SITENAME}} pediu a recuperação da sua palavra-passe no projeto {{SITENAME}} ($4). {{PLURAL:$3|A seguinte conta de utilizador está associada|As seguintes contas de utilizador estão associadas}} a este endereço de correio eletrónico:\n\n$2\n\n{{PLURAL:$3|Esta palavra-passe temporária irá|Estas palavras-passes temporárias irão}} expirar dentro de {{PLURAL:$5|um dia|$5 dias}}.\nDeve autenticar-se e escolher uma palavra-passe nova agora. Se outra pessoa fez este pedido, ou se entretanto se recordou da sua palavra-passe original e já não deseja alterá-la, pode ignorar esta mensagem e continuar a usar a palavra-passe antiga.\";'),('pt','messages:passwordreset-emailelement','s:73:\"{{GENDER:$1|Utilizador|Utilizadora}}: \n$1\n\nPalavra-passe temporária: \n$2\";'),('pt','messages:passwordreset-emailsentemail','s:122:\"Se este é o endereço de correio eletrónico associado a esta conta, ser-lhe-á enviada uma palavra-passe de reposição.\";'),('pt','messages:passwordreset-emailsentusername','s:137:\"Se houver um endereço de correio eletrónico associado a esta conta, ser-lhe-á enviada uma mensagem para redefinir a sua palavra-passe.\";'),('pt','messages:passwordreset-emailsent-capture2','s:278:\"{{PLURAL:$1|A mensagem|As mensagens}} de redefinição da palavra-passe {{PLURAL:$1|foi enviada|foram enviadas}} para o seu correio eletrónico. {{PLURAL:$1|O nome de utilizador e palavra-passe encontram-se|A lista de nomes de utilizador e palavras-passe encontra-se}} a seguir.\";'),('pt','messages:passwordreset-emailerror-capture2','s:228:\"O envio do correio {{GENDER:$2|ao utilizador|à utilizadora|a(o) utilizador(a)}} falhou: $1 {{PLURAL:$3|O nome de utilizador e palavra-passe são mostrados aqui|A lista de nomes de utilizador e palavras-passe é mostrada aqui}}.\";'),('pt','messages:passwordreset-nocaller','s:34:\"Um interlocutor deve ser fornecido\";'),('pt','messages:passwordreset-nosuchcaller','s:34:\"A pessoa que chama não existe: $1\";'),('pt','messages:passwordreset-ignored','s:99:\"A reposição de palavra-passe não foi realizada. Talvez o fornecedor não tenha sido configurado?\";'),('pt','messages:passwordreset-invalideamil','s:29:\"Correio eletrónico inválido\";'),('pt','messages:passwordreset-nodata','s:80:\"Não foram fornecidos nome de utilizador(a) nem endereço de correio eletrónico\";'),('pt','messages:changeemail','s:53:\"Alterar ou remover o endereço de correio eletrónico\";'),('pt','messages:changeemail-header','s:255:\"Complete este formulário para alterar o seu endereço de correio eletrónico. Se quer eliminar a associação de qualquer endereço de correio eletrónico com a sua conta, deixe em branco o novo endereço de correio eletrónico ao submeter o formulário.\";'),('pt','messages:changeemail-no-info','s:66:\"Precisa de iniciar sessão para aceder diretamente a esta página.\";'),('pt','messages:changeemail-oldemail','s:26:\"Correio eletrónico atual:\";'),('pt','messages:changeemail-newemail','s:38:\"Novo endereço de correio eletrónico:\";'),('pt','messages:changeemail-newemail-help','s:223:\"Este campo deve ser deixado em branco caso pretenda remover o seu endereço de correio eletrónico.\nNão será capaz de redefinir a sua palavra-passe nem receber mensagens eletrónicas desta wiki se efetuar esta operação.\";'),('pt','messages:changeemail-none','s:8:\"(nenhum)\";'),('pt','messages:changeemail-password','s:36:\"A sua palavra-passe em {{SITENAME}}:\";'),('pt','messages:changeemail-submit','s:27:\"Alterar correio eletrónico\";'),('pt','messages:changeemail-throttled','s:102:\"Realizou demasiadas tentativas de início de sessão.\nAguarde $1 antes de tentar novamente, por favor.\";'),('pt','messages:changeemail-nochange','s:45:\"Por favor insira um novo endereço de e-mail.\";'),('pt','messages:resettokens','s:16:\"Redefinir chaves\";'),('pt','messages:resettokens-text','s:186:\"Pode redefinir as chaves de acesso a certos dados privados associados à sua conta aqui.\n\nDeve fazê-lo se as divulgou acidentalmente a alguém ou se a sua conta tiver sido comprometida.\";'),('pt','messages:resettokens-no-tokens','s:31:\"Não há chaves para redefinir.\";'),('pt','messages:resettokens-tokens','s:7:\"Chaves:\";'),('pt','messages:resettokens-token-label','s:20:\"$1 (valor atual: $2)\";'),('pt','messages:resettokens-watchlist-token','s:87:\"Chave para o \'\'feed\'\' Atom/RSS de [[Special:Watchlist|mudanças às páginas vigiadas]]\";'),('pt','messages:resettokens-done','s:28:\"As chaves foram redefinidas.\";'),('pt','messages:resettokens-resetbutton','s:29:\"Redefinir chaves selecionadas\";'),('pt','messages:bold_sample','s:15:\"Texto a negrito\";'),('pt','messages:bold_tip','s:15:\"Texto a negrito\";'),('pt','messages:italic_sample','s:17:\"Texto em itálico\";'),('pt','messages:italic_tip','s:17:\"Texto em itálico\";'),('pt','messages:link_sample','s:20:\"Título da ligação\";'),('pt','messages:link_tip','s:17:\"Ligação interna\";'),('pt','messages:extlink_sample','s:40:\"http://www.example.com ligação externa\";'),('pt','messages:extlink_tip','s:48:\"Ligação externa (lembre-se do prefixo http://)\";'),('pt','messages:headline_sample','s:19:\"Texto do cabeçalho\";'),('pt','messages:headline_tip','s:20:\"Secção de nível 2\";'),('pt','messages:nowiki_sample','s:33:\"Inserir texto não-formatado aqui\";'),('pt','messages:nowiki_tip','s:25:\"Ignorar formatação wiki\";'),('pt','messages:image_sample','s:11:\"Exemplo.jpg\";'),('pt','messages:image_tip','s:20:\"Ficheiro incorporado\";'),('pt','messages:media_sample','s:11:\"Exemplo.ogg\";'),('pt','messages:media_tip','s:23:\"Ligação para ficheiro\";'),('pt','messages:sig_tip','s:33:\"A sua assinatura, com hora e data\";'),('pt','messages:hr_tip','s:40:\"Linha horizontal (utilize moderadamente)\";'),('pt','messages:summary','s:7:\"Resumo:\";'),('pt','messages:subject','s:8:\"Assunto:\";'),('pt','messages:minoredit','s:26:\"Marcar como edição menor\";'),('pt','messages:watchthis','s:19:\"Vigiar esta página\";'),('pt','messages:savearticle','s:14:\"Gravar página\";'),('pt','messages:savechanges','s:19:\"Gravar alterações\";'),('pt','messages:publishpage','s:16:\"Publicar página\";'),('pt','messages:publishchanges','s:21:\"Publicar alterações\";'),('pt','messages:preview','s:10:\"Antevisão\";'),('pt','messages:showpreview','s:17:\"Antever resultado\";'),('pt','messages:showdiff','s:20:\"Mostrar alterações\";'),('pt','messages:blankarticle','s:168:\"<strong>Aviso:</strong> A página que está prestes a criar está em branco.  \nSe clicar \"{{int:savearticle}}\" outra vez, a página será criada sem qualquer conteúdo.\";'),('pt','messages:anoneditwarning','s:315:\"<strong>Aviso</strong>: Não iniciou sessão. O seu endereço IP será registado no histórico de edições desta página. Se <strong>[$1 iniciar sessão]</strong> ou <strong>[$2 criar uma conta]</strong>, as suas edições serão registadas com o seu nome de utilizador(a), bem como usufruir de outros benefícios.\";'),('pt','messages:anonpreviewwarning','s:105:\"\'\'Não iniciou sessão. Ao gravar, registará o seu endereço IP no histórico de edições da página.\'\'\";'),('pt','messages:missingsummary','s:133:\"\'\'\'Atenção:\'\'\' Não introduziu um resumo da edição.\nSe clicar novamente \"Gravar página\" a sua edição será gravada sem resumo.\";'),('pt','messages:selfredirect','s:249:\"<strong>Aviso:</strong> Está a redirecionar esta página para si mesma.\nPode ter especificado o destino errado para a página ou até a editar a página errada.\nSe clicar em \"{{int:savearticle}}\" novamente, o redirecionamento será criado na mesma.\";'),('pt','messages:missingcommenttext','s:43:\"Introduza um comentário abaixo, por favor.\";'),('pt','messages:missingcommentheader','s:162:\"<strong>Atenção:</strong> Não introduziu um assunto para este comentário.\nSe clicar novamente \"{{int:savearticle}}\", a sua edição será gravada sem assunto.\";'),('pt','messages:summary-preview','s:21:\"Antevisão do resumo:\";'),('pt','messages:subject-preview','s:22:\"Antevisão do assunto:\";'),('pt','messages:previewerrortext','s:62:\"Ocorreu um erro enquanto tentava antever as suas alterações.\";'),('pt','messages:blockedtitle','s:28:\"O utilizador está bloqueado\";'),('pt','messages:blockedtext','s:749:\"<strong>O seu nome de utilizador ou endereço IP foram bloqueados.</strong>\n\nO bloqueio foi realizado por $1.\nO motivo apresentado foi <em>$2</em>.\n\n* Início do bloqueio: $8\n* Expiração do bloqueio: $6\n* Destinatário do bloqueio: $7\n\nPode contactar $1 ou outro [[{{MediaWiki:Grouppage-sysop}}|administrador]] para discutir o bloqueio.\nNote que para utilizar a funcionalidade \"Contactar utilizador\" precisa de ter um endereço de correio eletrónico válido nas suas [[Special:Preferences|preferências]] e de não lhe ter sido bloqueado o uso desta funcionalidade.\nO seu endereço IP neste momento é $3 e a identificação (ID) do bloqueio é #$5.\nInclua todos os detalhes acima em quaisquer contactos relacionados com este bloqueio, por favor.\";'),('pt','messages:autoblockedtext','s:782:\"O seu endereço IP foi bloqueado de forma automática porque foi utilizado recentemente por outro utilizador, o qual foi bloqueado por $1.\nO motivo apresentado foi:\n\n:<em>$2</em>\n\n* Início do bloqueio: $8\n* Expiração do bloqueio: $6\n* Destinatário do bloqueio: $7\n\nPode contactar $1 ou outro [[{{MediaWiki:Grouppage-sysop}}|administrador]] para discutir o bloqueio.\n\nNote que para utilizar a funcionalidade \"Contactar utilizador\" precisa de ter um endereço de correio eletrónico válido nas suas [[Special:Preferences|preferências]] e de não lhe ter sido bloqueado o uso desta funcionalidade.\n\nO seu endereço IP neste momento é $3 e a identificação (ID) do bloqueio é #$5.\nInclua todos os detalhes acima em quaisquer contactos relacionados com este bloqueio, por favor.\";'),('pt','messages:blockednoreason','s:23:\"sem motivo especificado\";'),('pt','messages:whitelistedittext','s:41:\"Precisa de $1 para poder editar páginas.\";'),('pt','messages:confirmedittext','s:204:\"Precisa de confirmar o seu endereço de correio eletrónico antes de começar a editar páginas.\nIntroduza e valide o endereço através das [[Special:Preferences|preferências do utilizador]], por favor.\";'),('pt','messages:nosuchsectiontitle','s:39:\"Não foi possível encontrar a secção\";'),('pt','messages:nosuchsectiontext','s:113:\"Tentou editar uma secção que não existe.\nEla pode ter sido movida ou removida enquanto estava a ver a página.\";'),('pt','messages:loginreqtitle','s:30:\"Início de sessão necessário\";'),('pt','messages:loginreqlink','s:6:\"entrar\";'),('pt','messages:loginreqpagetext','s:39:\"Precisa de $1 para ver outras páginas.\";'),('pt','messages:accmailtitle','s:22:\"Palavra-passe enviada.\";'),('pt','messages:accmailtext','s:201:\"Uma palavra-passe gerada aleatoriamente para [[User talk:$1|$1]] foi enviada para $2.\n\nEla pode ser alterada na página [[Special:ChangePassword|de alteração da palavra-passe]] após iniciar sessão.\";'),('pt','messages:newarticle','s:6:\"(Nova)\";'),('pt','messages:newarticletext','s:258:\"Seguiu uma ligação para uma página que ainda não existe.\nPara criá-la, escreva o seu conteúdo na caixa abaixo (consulte a [$1 página de ajuda] para mais detalhes).\nSe chegou aqui por engano, clique o botão \'\'\'voltar\'\'\' (ou \'\'back\'\') do seu navegador.\";'),('pt','messages:anontalkpagetext','s:491:\"----\'\'Esta é a página de discussão de um utilizador anónimo que ainda não criou uma conta ou não a utiliza, pelo que temos de utilizar o endereço IP para identificá-lo(a).\nUm endereço IP pode ser partilhado por vários utilizadores.\nSe é um utilizador anónimo e sente que lhe foram direcionados comentários irrelevantes, por favor [[Special:CreateAccount|crie uma conta]] ou [[Special:UserLogin|inicie sessão]] para evitar futuras confusões com outros utilizadores anónimos.\'\'\";'),('pt','messages:noarticletext','s:311:\"Ainda não existe texto nesta página.\nPode [[Special:Search/{{PAGENAME}}|pesquisar o título desta página]] noutras páginas,\n<span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} procurar registos relacionados]\nou [{{fullurl:{{FULLPAGENAME}}|action=edit}} editar esta página]</span>.\";'),('pt','messages:noarticletext-nopermission','s:301:\"Ainda não existe texto nesta página.\nPode [[Special:Search/{{PAGENAME}}|pesquisar o título desta página]] noutras páginas, ou <span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} procurar nos registos relacionados]</span>, mas não tem permissão para criar esta página.\";'),('pt','messages:missing-revision','s:308:\"A revisão #$1 da página denominada \"{{FULLPAGENAME}}\" não existe.\n\nIsto é geralmente causado por seguir uma ligação de histórico desatualizada para uma página que foi eliminada.\nOs detalhes podem ser encontrados no [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} registo de eliminação].\";'),('pt','messages:userpage-userdoesnotexist','s:128:\"A conta \"<nowiki>$1</nowiki>\" não se encontra registada.\nVerifique se deseja realmente criar ou editar esta página, por favor.\";'),('pt','messages:userpage-userdoesnotexist-view','s:48:\"A conta de utilizador \"$1\" não está registada.\";'),('pt','messages:blocked-notice-logextract','s:103:\"Este utilizador está bloqueado.\nPara referência, o último registo de bloqueio é apresentado abaixo:\";'),('pt','messages:clearyourcache','s:618:\"\'\'\'Nota:\'\'\' Após gravar, terá de limpar a \'\'cache\'\' do seu navegador para ver as alterações.\n*\'\'\'Firefox / Safari:\'\'\' Pressione \'\'Shift\'\' enquanto clica \'\'Recarregar\'\', ou pressione \'\'Ctrl-F5\'\' ou \'\'Ctrl-R\'\' (\'\'⌘-R\'\' no Mac)\n*\'\'\'Google Chrome:\'\'\' Pressione \'\'Ctrl-Shift-R\'\' (\'\'⌘-Shift-R\'\' no Mac)\n*\'\'\'Internet Explorer:\'\'\' Pressione \'\'Ctrl\'\' enquanto clica \'\'Recarregar\'\', ou pressione \'\'Ctrl-F5\'\'\n*\'\'\'Opera:\'\'\' Ir para <em>Menu → Configurações</em> (<em>Opera → Preferências</em> no Mac) e, em seguida, <em>Privacidade e segurança → Limpar dados de navegação → Imagens e ficheiros em cache</em>.\";'),('pt','messages:usercssyoucanpreview','s:90:\"\'\'\'Dica:\'\'\' Use o botão \"{{int:showpreview}}\" para testar o seu novo CSS antes de gravar.\";'),('pt','messages:userjsyoucanpreview','s:97:\"\'\'\'Dica:\'\'\' Use o botão \"{{int:showpreview}}\" para testar o seu novo JavaScript antes de gravar.\";'),('pt','messages:usercsspreview','s:96:\"\'\'\'Lembre-se de que está apenas a antever o seu CSS particular.\nEste ainda não foi gravado!\'\'\'\";'),('pt','messages:userjspreview','s:110:\"\'\'\'Lembre-se que está apenas a testar ou antever o seu JavaScript particular.\'\'\'\nEste ainda não foi gravado!\";'),('pt','messages:sitecsspreview','s:89:\"\'\'\'Lembre-se de que está apenas a antever este CSS.\'\'\'\n\'\'\'Ele ainda não foi gravado!\'\'\'\";'),('pt','messages:sitejspreview','s:104:\"\'\'\'Lembre-se de que está apenas a antever este código JavaScript.\'\'\'\n\'\'\'Ele ainda não foi gravado!\'\'\'\";'),('pt','messages:userinvalidcssjstitle','s:190:\"\'\'\'Aviso:\'\'\' Não existe um tema \"$1\". Lembre-se que as páginas .css e  .js têm um título em minúsculas, exemplo: {{ns:user}}:Alguém/vector.css em vez de {{ns:user}}:Alguém/Vector.css.\";'),('pt','messages:updated','s:12:\"(Atualizado)\";'),('pt','messages:note','s:11:\"\'\'\'Nota:\'\'\'\";'),('pt','messages:previewnote','s:108:\"\'\'\'Lembre-se que esta é apenas uma antevisão do resultado.\'\'\'\nAs modificações ainda não foram gravadas!\";'),('pt','messages:continue-editing','s:27:\"Ir para a área de edição\";'),('pt','messages:previewconflict','s:121:\"Esta antevisão do resultado apresenta o texto da caixa de edição acima tal como este aparecerá se escolher gravá-lo.\";'),('pt','messages:session_fail_preview','s:400:\"Desculpe! Não foi possível processar a edição devido à perda dos dados da sua sessão.\n\nA sua sessão poderá ter sido encerrada. <strong>Por favor, verifique se ainda está autenticado e tente novamente</strong>. \nCaso continue a não funcionar, tente [[Special:UserLogout|sair]] e voltar a entrar na sua conta, e verifique se o seu navegador permite a utilização de \'\'cookies\'\' deste sítio.\";'),('pt','messages:session_fail_preview_html','s:505:\"Desculpe! Não foi possível processar a edição devido à perda de dados da sua sessão.\n\n<em>Como a wiki {{SITENAME}} possibilita o uso de HTML puro, a antevisão está oculta por precaução contra ataques com JavaScript.</em>\n\n<strong>Se esta é uma tentativa legítima de edição tente novamente, por favor</strong>. \nCaso continue a não funcionar, tente [[Special:UserLogout|sair]] e voltar a entrar na sua conta, e verifique se o seu navegador permite a utilização de \'\'cookies\'\' deste sítio.\";'),('pt','messages:token_suffix_mismatch','s:259:\"\'\'\'A edição foi rejeitada porque o seu navegador alterou os sinais de pontuação no editor.\'\'\'\nA edição foi rejeitada para evitar perdas no texto da página.\nIsso acontece ocasionalmente quando se usa um serviço de proxy anonimizador mal configurado.\'\'\'\";'),('pt','messages:edit_form_incomplete','s:150:\"\'\'\'Algumas partes do formulário de edição não chegaram ao servidor; verifique que a sua edição continua intacta e tente novamente, por favor.\'\'\'\";'),('pt','messages:editing','s:11:\"A editar $1\";'),('pt','messages:creating','s:10:\"A criar $1\";'),('pt','messages:editingsection','s:22:\"A editar $1 (secção)\";'),('pt','messages:editingcomment','s:27:\"A editar $1 (nova secção)\";'),('pt','messages:editconflict','s:24:\"Conflito de edição: $1\";'),('pt','messages:explainconflict','s:338:\"A página foi alterada por alguém desde que começou a editá-la.\nA caixa de texto abaixo mostra o texto existente neste momento.\nAs suas mudanças são mostradas na área ao fundo da página.\nTerá de reintegrar as suas mudanças no texto da caixa abaixo.\n\'\'\'Só\'\'\' o texto desta caixa será gravado quando clicar \"{{int:savearticle}}\".\";'),('pt','messages:yourtext','s:11:\"O seu texto\";'),('pt','messages:storedversion','s:15:\"Versão gravada\";'),('pt','messages:nonunicodebrowser','s:285:\"<strong>Aviso: O seu navegador não é compatível com as especificações Unicode.</strong>\nFoi ativado um sistema de edição alternativo que lhe permite editar as páginas com segurança: os caracteres não-ASCII aparecerão na caixa de edição no formato de códigos hexadecimais.\";'),('pt','messages:editingold','s:147:\"\'\'\'Aviso: Está a editar uma revisão desatualizada desta página.\'\'\'\nSe gravar, todas as mudanças feitas a partir desta revisão serão perdidas.\";'),('pt','messages:yourdiff','s:11:\"Diferenças\";'),('pt','messages:copyrightwarning','s:476:\"Note, por favor, que todas as suas contribuições na {{SITENAME}} são consideradas publicadas nos termos da licença $2 (consulte $1 para mais detalhes).\nSe não deseja que o seu texto possa ser inexoravelmente editado e redistribuído, não o envie.\nGarante-nos também que isto é algo escrito por si, ou copiado do domínio público ou de outra fonte de teor livre.<br />\n\'\'\'Não envie conteúdos cujos direitos de autor estão protegidos, sem ter a devida permissão!\'\'\'\";'),('pt','messages:copyrightwarning2','s:472:\"Note, por favor, que todas as suas contribuições na {{SITENAME}} podem ser editadas, alteradas ou removidas por outros utilizadores.\nSe não deseja que o seu texto seja inexoravelmente editado, não o envie.<br />\nGarante-nos também que isto é algo escrito por si, ou copiado do domínio público ou de outra fonte de teor livre (consulte $1 para mais detalhes).<br />\n\'\'\'Não envie conteúdos cujos direitos de autor estão protegidos, sem ter a devida permissão!\'\'\'\";'),('pt','messages:editpage-cannot-use-custom-model','s:59:\"O modelo de conteúdo desta página não pode ser alterado.\";'),('pt','messages:longpageerror','s:175:\"\'\'\'Erro: O texto que submeteu ocupa {{PLURAL:$1|um kilobyte|$1 kilobytes}}, que excede o máximo de {{PLURAL:$2|um kilobyte|$2 kilobytes}}.\'\'\'\nA página não pode ser gravada.\";'),('pt','messages:readonlywarning','s:312:\"<strong>Atenção: A base de dados foi bloqueada para manutenção, pelo que não poderá gravar as suas edições neste momento.</strong>\nPode, contudo, copiar e colar o seu texto num ficheiro de texto e guardá-lo para mais tarde.\n\nO administrador do sistema que a bloqueou forneceu a seguinte explicação: $1\";'),('pt','messages:protectedpagewarning','s:145:\"\'\'\'Aviso: Esta página foi protegida para só poder ser editada por administradores.\'\'\'\nO último registo é apresentado abaixo para referência:\";'),('pt','messages:semiprotectedpagewarning','s:170:\"\'\'\'Nota:\'\'\' Esta página foi protegida de modo a que apenas utilizadores registados a possam editar.\nA última entrada no histórico é fornecida abaixo como referência.\";'),('pt','messages:cascadeprotectedwarning','s:231:\"<strong>Aviso:</strong> Esta página está protegida de forma que apenas os administradores possam editá-la, porque se encontra transcluída {{PLURAL:$1|na seguinte página protegida|nas seguintes páginas protegidas}} em cascata:\";'),('pt','messages:titleprotectedwarning','s:212:\"\'\'\'Aviso: Esta página foi protegida de forma a que [[Special:ListGroupRights|privilégios específicos]] sejam necessários para criá-la.\'\'\'\nPara referência, é apresentada abaixo a última entrada do registo:\";'),('pt','messages:templatesused','s:80:\"{{PLURAL:$1|Predefinição utilizada|Predefinições utilizadas}} nesta página:\";'),('pt','messages:templatesusedpreview','s:83:\"{{PLURAL:$1|Predefinição utilizada|Predefinições utilizadas}} nesta antevisão:\";'),('pt','messages:templatesusedsection','s:81:\"{{PLURAL:$1|Predefinição utilizada|Predefinições utilizadas}} nesta secção:\";'),('pt','messages:template-protected','s:11:\"(protegida)\";'),('pt','messages:template-semiprotected','s:16:\"(semi-protegida)\";'),('pt','messages:hiddencategories','s:81:\"Esta página pertence a {{PLURAL:$1|uma categoria oculta|$1 categorias ocultas}}