|thumb|left|texto]]</nowiki></code>\'\'\' para mostrar uma imagem com a dimensão horizontal de 200 píxeis, dentro de uma caixa, na margem esquerda, contendo \'texto\' como descrição (pode usar subconjuntos destas características);\n* \'\'\'<code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:ficheiro.ogg]]</nowiki></code>\'\'\' para apresentar uma ligação direta para o ficheiro em vez de mostrá-lo, quer este tenha por conteúdo uma imagem ou outros dados.\";'),('pt','messages:upload-permitted','s:76:\"{{PLURAL:$2|Tipo|Tipos}} de ficheiro {{PLURAL:$2|permitido|permitidos}}: $1.\";'),('pt','messages:upload-preferred','s:76:\"{{PLURAL:$2|Tipo|Tipos}} de ficheiro {{PLURAL:$2|preferido|preferidos}}: $1.\";'),('pt','messages:upload-prohibited','s:74:\"{{PLURAL:$2|Tipo|Tipos}} de ficheiro {{PLURAL:$2|proibido|proibidos}}: $1.\";'),('pt','messages:uploadlogpage','s:23:\"Registo de carregamento\";'),('pt','messages:uploadlogpagetext','s:129:\"Segue-se uma lista dos carregamentos mais recentes.\nConsulte a [[Special:NewFiles|galeria de novos ficheiros]] para visioná-los.\";'),('pt','messages:filename','s:16:\"Nome do ficheiro\";'),('pt','messages:filedesc','s:23:\"Descrição do ficheiro\";'),('pt','messages:fileuploadsummary','s:7:\"Resumo:\";'),('pt','messages:filereuploadsummary','s:25:\"Alterações ao ficheiro:\";'),('pt','messages:filestatus','s:29:\"Estado dos direitos de autor:\";'),('pt','messages:filesource','s:6:\"Fonte:\";'),('pt','messages:ignorewarning','s:36:\"Ignorar o aviso e gravar o ficheiro.\";'),('pt','messages:ignorewarnings','s:23:\"Ignorar todos os avisos\";'),('pt','messages:minlength1','s:56:\"Os nomes de ficheiros devem de ter pelo menos uma letra.\";'),('pt','messages:illegalfilename','s:158:\"O nome do ficheiro \"$1\" contém caracteres que não são permitidos no título das páginas.\nAltere o nome do ficheiro e tente enviá-lo novamente, por favor.\";'),('pt','messages:filename-toolong','s:55:\"Os nomes de ficheiros não podem ter mais de 240 bytes.\";'),('pt','m