r-svg','s:175:\"A configuração do atributo \"handler\" com destino remoto/de dados/<i>script</i> em ficheiros SVG está bloqueada. Foi detetado <code>$1=\"$2\"</code> no ficheiro SVG carregado.\";'),('pt','messages:uploaded-remote-url-svg','s:161:\"A configuração de qualquer atributo de estilo com uma URL remota em ficheiros SVG está bloqueada. Foi detetado <code>$1=\"$2\"</code> no ficheiro SVG carregado.\";'),('pt','messages:uploaded-image-filter-svg','s:104:\"Foi encontrado um filtro de imagem com a URL: <code>&lt;$1 $2=\"$3\"&gt;</code> no ficheiro SVG carregado.\";'),('pt','messages:uploadscriptednamespace','s:65:\"Este ficheiro SVG contém um domínio que não é permitido \"$1\".\";'),('pt','messages:uploadinvalidxml','s:56:\"Erro detectado na análise do XML do ficheiro carregado.\";'),('pt','messages:uploadvirus','s:43:\"O ficheiro contém um vírus! \nDetalhes: $1\";'),('pt','messages:uploadjava','s:175:\"Este é um ficheiro ZIP que contém um ficheiro .class de Java.\nNão é permitido o carregamento de ficheiros Java, porque estes podem contornar as restrições de segurança.\";'),('pt','messages:upload-source','s:18:\"Ficheiro de origem\";'),('pt','messages:sourcefilename','s:27:\"Nome do ficheiro de origem:\";'),('pt','messages:sourceurl','s:10:\"URL fonte:\";'),('pt','messages:destfilename','s:28:\"Nome do ficheiro de destino:\";'),('pt','messages:upload-maxfilesize','s:31:\"Tamanho máximo do ficheiro: $1\";'),('pt','messages:upload-description','s:23:\"Descrição do ficheiro\";'),('pt','messages:upload-options','s:24:\"Opções de carregamento\";'),('pt','messages:watchthisupload','s:20:\"Vigiar este ficheiro\";'),('pt','messages:filewasdeleted','s:135:\"Um ficheiro com este nome foi carregado anteriormente e subsequentemente eliminado.\nDeverá verificar o $1 antes de voltar a enviá-lo.\";'),('pt','messages:filename-thumb-name','s:222:\"Isto parece ser o título de uma miniatura. Por favor, não volte a carregar miniaturas na mesma wiki. Se este não é o caso, corrija o