f_anon_editor','s:22:\"utilizador anónimo $1\";'),('pt','messages:enotif_body','s:848:\"{{GENDER:$WATCHINGUSERNAME|Caro|Cara|Caro(a)}} $WATCHINGUSERNAME,\n\n$PAGEINTRO $NEWPAGE\n\nResumo da edição: $PAGESUMMARY $PAGEMINOREDIT\n\nContacte o editor:\ncorreio eletrónico: $PAGEEDITOR_EMAIL\nwiki: $PAGEEDITOR_WIKI\n\nAté se autenticar e visitar novamente esta página, não receberá mais notificações das alterações futuras. Também pode reativar as notificações para todas páginas na sua lista de páginas vigiadas.\n\nO seu sistema de notificação amigável da {{SITENAME}}\n\n--\nPara alterar as suas preferências de notificação por correio eletrónico, visite\n{{canonicalurl:{{#special:Preferences}}}}\n\nPara alterar as suas preferências das páginas vigiadas, visite\n{{canonicalurl:{{#special:EditWatchlist}}}}\n\nPara retirar a página da lista de páginas vigiadas, visite\n$UNWATCHURL\n\nPara comentários e pedidos de ajuda:\n$HELPPAGE\";'),('pt','messages:created','s:6:\"criada\";'),('pt','messages:changed','s:8:\"alterada\";'),('pt','messages:deletepage','s:16:\"Eliminar página\";'),('pt','messages:confirm','s:9:\"Confirmar\";'),('pt','messages:excontent','s:21:\"o conteúdo era: \"$1\"\";'),('pt','messages:excontentauthor','s:98:\"o conteúdo era: \"$1\", e o único editor \"[[Special:Contributions/$2|$2]]\" ([[User talk:$2|talk]])\";'),('pt','messages:exbeforeblank','s:39:\"o conteúdo antes de esvaziar era: \"$1\"\";'),('pt','messages:delete-confirm','s:13:\"Eliminar \"$1\"\";'),('pt','messages:delete-legend','s:8:\"Eliminar\";'),('pt','messages:historywarning','s:137:\"<strong>Aviso:</strong> A página que está prestes a eliminar tem um histórico com aproximadamente $1 {{PLURAL:$1|revisão|revisões}}:\";'),('pt','messages:historyaction-submit','s:7:\"Mostrar\";'),('pt','messages:confirmdeletetext','s:266:\"Está prestes a eliminar uma página juntamente com todo o seu histórico.\nConfirme que é realmente esta a sua intenção, que compreende as consequências e que o faz de acordo com a