opdown','s:335:\"*Razões comuns para um bloqueio\n** Inserção de informações falsas\n** Remoção de conteúdos de páginas\n** Inserção de \"spam\" para sítios externos\n** Inserção de conteúdo sem sentido/incompreensível nas páginas\n** Comportamento intimidador/inoportuno\n** Uso abusivo de contas múltiplas\n** Nome de utilizador inaceitável\";'),('pt','messages:ipb-hardblock','s:72:\"Impedir que utilizadores autenticados editem a partir deste endereço IP\";'),('pt','messages:ipbcreateaccount','s:29:\"Impedir a criação de contas\";'),('pt','messages:ipbemailban','s:51:\"Impedir utilizador(a) de enviar correio eletrónico\";'),('pt','messages:ipbenableautoblock','s:152:\"Bloquear automaticamente o endereço IP mais recente deste(a) utilizador(a) e todos os endereços IP subsequentes a partir dos quais ele(a) tente editar\";'),('pt','messages:ipbsubmit','s:30:\"Bloquear este(a) utilizador(a)\";'),('pt','messages:ipbother','s:15:\"Outro período:\";'),('pt','messages:ipboptions','s:157:\"2 horas:2 hours,1 dia:1 day,3 dias:3 days,1 semana:1 week,2 semanas:2 weeks,1 mês:1 month,3 meses:3 months,6 meses:6 months,1 ano:1 year,indefinido:infinite\";'),('pt','messages:ipbhidename','s:49:\"Ocultar nome de utilizador nas edições e listas\";'),('pt','messages:ipbwatchuser','s:74:\"Vigiar as páginas de utilizador(a) e de discussão deste(a) utilizador(a)\";'),('pt','messages:ipb-disableusertalk','s:97:\"Impedir que este(a) utilizador(a) edite a sua página de discussão enquanto estiver bloqueado(a)\";'),('pt','messages:ipb-change-block','s:52:\"Voltar a bloquear o utilizador com estes parâmetros\";'),('pt','messages:ipb-confirm','s:20:\"Confirmar o bloqueio\";'),('pt','messages:badipaddress','s:22:\"Endereço IP inválido\";'),('pt','messages:blockipsuccesssub','s:17:\"Bloqueio efetuado\";'),('pt','messages:blockipsuccesstext','s:153:\"[[Special:Contributions/$1|$1]] foi {{GENDER:$1|bloqueado|bloqueada}}.<br />\nConsulte a [[Special:BlockList|lista de bloqueios]] para rever os bloqueios.\";'),('pt','messages:ipb-blockingself','s:82:\"Está prestes a bloquear-se a si próprio. Tem a certeza de que pretende fazê-lo?\";'),('pt','messages:ipb-confirmhideuser','s:207:\"Está prestes a bloquear um utilizador com \"Ocultar nome de utilizador/IP\" ativado. Isto irá suprimir o nome do utilizador de todas as listas e entradas dos registos. Tem a certeza de que pretende fazê-lo?\";'),('pt','messages:ipb-confirmaction','s:85:\"Se tem a certeza de que quer fazê-lo, marque o campo \"{{int:ipb-confirm}}\" ao fundo.\";'),('pt','messages:ipb-edit-dropdown','s:26:\"Editar motivos de bloqueio\";'),('pt','messages:ipb-unblock-addr','s:14:\"Desbloquear $1\";'),('pt','messages:ipb-unblock','s:41:\"Desbloquear um utilizador ou endereço IP\";'),('pt','messages:ipb-blocklist','s:26:\"Ver bloqueios em vigência\";'),('pt','messages:ipb-blocklist-contribs','s:35:\"Contribuições de {{GENDER:$1|$1}}\";'),('pt','messages:ipb-blocklist-duration-left','s:8:\"resta $1\";'),('pt','messages:unblockip','s:22:\"Desbloquear utilizador\";'),('pt','messages:unblockiptext','s:119:\"Utilize o formulário abaixo para restaurar o acesso de escrita de um endereço IP ou utilizador previamente bloqueado.\";'),('pt','messages:ipusubmit','s:21:\"Remover este bloqueio\";'),('pt','messages:unblocked','s:31:\"[[User:$1|$1]] foi desbloqueado\";'),('pt','messages:unblocked-range','s:26:\"A gama $1 foi desbloqueada\";'),('pt','messages:unblocked-id','s:41:\"O bloqueio de $1 foi removido com sucesso\";'),('pt','messages:unblocked-ip','s:49:\"[[Special:Contributions/$1|$1]] foi desbloqueado.\";'),('pt','messages:blocklist','s:23:\"Utilizadores bloqueados\";'),('pt','messages:ipblocklist','s:23:\"Utilizadores bloqueados\";'),('pt','messages:ipblocklist-legend','s:32:\"Procurar um utilizador bloqueado\";'),('pt','messages:blocklist-userblocks','s:27:\"Ocultar bloqueios de contas\";'),('pt','messages:blocklist-tempblocks','s:30:\"Ocultar bloqueios temporários\";'),('pt','messages:blocklist-addressblocks','s:30:\