de ver ou editar o bloqueio deste utilizador.\";'),('pt','messages:ipbblocked','s:64:\"Não pode bloquear ou desbloquear outros, porque está bloqueado\";'),('pt','messages:ipbnounblockself','s:47:\"Não lhe é permitido desbloquear-se a si mesmo\";'),('pt','messages:lockdb','s:24:\"Bloquear a base de dados\";'),('pt','messages:unlockdb','s:27:\"Desbloquear a base de dados\";'),('pt','messages:lockdbtext','s:347:\"Bloquear a base de dados impede todos os utilizadores de editar páginas, mudar as suas preferências, editar a lista de páginas vigiadas e executar qualquer outra operação que altere a base de dados.\nConfirme que é precisamente isso que pretende fazer e que vai desbloquear a base de dados quando a manutenção estiver concluída, por favor.\";'),('pt','messages:unlockdbtext','s:275:\"Desbloquear a base de dados vai possibilitar a todos os utilizadores editar páginas, mudar as suas preferências, alterar as suas listas de páginas vigiadas e executar qualquer outra operação que altere a base de dados. Confirme que é isso que pretende fazer, por favor.\";'),('pt','messages:lockconfirm','s:49:\"Sim, pretendo realmente bloquear a base de dados.\";'),('pt','messages:unlockconfirm','s:52:\"Sim, pretendo realmente desbloquear a base de dados.\";'),('pt','messages:lockbtn','s:24:\"Bloquear a base de dados\";'),('pt','messages:unlockbtn','s:27:\"Desbloquear a base de dados\";'),('pt','messages:locknoconfirm','s:37:\"Não marcou a caixa de confirmação.\";'),('pt','messages:lockdbsuccesssub','s:27:\"Base de dados foi bloqueada\";'),('pt','messages:unlockdbsuccesssub','s:30:\"Base de dados foi desbloqueada\";'),('pt','messages:lockdbsuccesstext','s:127:\"A base de dados da {{SITENAME}} foi bloqueada.<br />\nLembre-se de [[Special:UnlockDB|remover o bloqueio]] após a manutenção.\";'),('pt','messages:unlockdbsuccesstext','s:33:\"A base de dados foi desbloqueada.\";'),('pt','messages:lockfilenotwritable','s:169:\"O ficheiro de bloqueio da base de dados não pode ser escrito.\nPara bloquear ou desbloquear a base de dados, este precisa de poder ser escrito pelo servidor de internet.\";'),('pt','messages:databaselocked','s:36:\"A base de dados já está bloqueada.\";'),('pt','messages:databasenotlocked','s:37:\"A base de dados não está bloqueada.\";'),('pt','messages:lockedbyandtime','s:35:\"(por {{GENDER:$1|$1}} em $2 às $3)\";'),('pt','messages:move-page','s:8:\"Mover $1\";'),('pt','messages:move-page-legend','s:13:\"Mover página\";'),('pt','messages:movepagetext','s:1153:\"Usando o formulário abaixo pode mover esta página e todo o seu histórico de edições para uma página nova com outro nome.\nA página original será transformada num redirecionamento para a página nova.\nPode corrigir de forma automática os redirecionamentos existentes que apontam para a página original.\nCaso escolha não o fazer, após a operação certifique-se de que dela não resultaram  [[Special:DoubleRedirects|redirecionamentos duplos]] ou [[Special:BrokenRedirects|quebrados]].\nÉ da sua responsabilidade verificar que as ligações continuam a apontar para onde é suposto que apontem.\n\nNote que a página \'\'\'não\'\'\' será movida se já existir uma página com o novo título, a menos que esta última seja um redirecionamento sem qualquer histórico de edições.\nIsto significa que pode mover uma página de volta para o seu nome original se a tiver movido por engano e que não pode mover uma página para cima de outra já existente.\n\n\'\'\'Nota:\'\'\'\nNuma página popular esta operação pode representar uma mudança drástica e inesperada;\ncertifique-se de que compreende as consequências da mudança antes de prosseguir, por favor.\";'),('pt','messages:movepagetext-noredirectfixer','s:1021:\"Usando o formulário abaixo, pode alterar o nome de uma página e mover todo o histórico desta para o nome novo.\nA página antiga é transformada numa página de redirecionamento para a nova.\nVerifique a existência de [[Special:DoubleRedirects|redirecionamentos duplos]] ou [[Special:BrokenRedirects|quebrados]].\nÉ da sua responsabilidade certificar-se de que as ligações continuam a apontar para onde é suposto.\n\nNote que a página \'\'\'não\'\'\' será movida se já existir uma página com o nome novo, a menos que esta página já existente esteja vazia ou seja uma página de redirecionamento e não tenha um histórico de edições.\nIsto também significa que, se se tiver enganado, pode alterar o nome da página movida de volta para o seu nome original; e que não pode sobrescrever o conteúdo de uma página existente.\n\n\'\'\'Nota:\'\'\'\nPara páginas populares, esta operação pode representar uma mudança drástica e inesperada;\ncertifique-se de que compreende as consequências da operação antes de continuar.\";'),('pt','messages:movepagetalktext','s:313:\"Se assinalar esta opção, e existir uma página de discussão associada, ela será automaticamente movida, a não ser que já exista uma página de discussão com o novo título que não esteja vazia.\n\nNeste caso, terá de mover a página de discussão manualmente, ou fundi-la com a existente, se assim desejar.\";'),('pt','messages:moveuserpage-warning','s:139:\"\'\'\'Aviso:\'\'\' Está prestes a mover uma página de utilizador. Note que a página será apenas movida, \'\'sem\'\' alterar o nome do utilizador.\";'),('pt','messages:movecategorypage-warning','s:206:\"<strong>Aviso:</strong> Está prestes a mover uma categoria. Por favor, note que apenas moverá a página da categoria e quaisquer páginas que estejam listadas <em>não</em> serão recategorizadas na nova.\";'),('pt','messages:movenologintext','s:113:\"Precisa de ser um utilizador registado e [[Special:UserLogin|ter sessão iniciada]] para poder mover uma página.\";'),('pt','messages:movenotallowed','s:40:\"Não tem permissão para mover páginas.\";'),('pt','messages:movenotallowedfile','s:44:\"Não possui permissão para mover ficheiros.\";'),('pt','messages:cant-move-user-page','s:80:\"Não tem permissão para mover páginas de utilizador (pode mover sub-páginas).\";'),('pt','messages:cant-mov