 válido.\";'),('pt','messages:confirmemail_pending','s:184:\"Um código de confirmação já lhe foi enviado;\ncaso tenha criado a conta recentemente, é recomendado que aguarde alguns minutos até o receber antes de tentar pedir um novo código.\";'),('pt','messages:confirmemail_send','s:31:\"Enviar código de confirmação\";'),('pt','messages:confirmemail_sent','s:33:\"Correio de confirmação enviado.\";'),('pt','messages:confirmemail_oncreate','s:241:\"Foi enviado um código de confirmação para o seu endereço de correio eletrónico.\nEste código não é necessário para se autenticar no sistema, mas será necessário para ativar qualquer funcionalidade baseada no uso de correio na wiki.\";'),('pt','messages:confirmemail_sendfailed','s:186:\"A {{SITENAME}} não conseguiu enviar a mensagem de confirmação.\nVerifique se o seu endereço de correio eletrónico tem caracteres inválidos.\n\nO sistema de correio devolveu o erro: $1\";'),('pt','messages:confirmemail_invalid','s:64:\"Código de confirmação inválido. O código pode ter expirado.\";'),('pt','messages:confirmemail_needlogin','s:68:\"Precisa de $1 para confirmar o seu endereço de correio eletrónico.\";'),('pt','messages:confirmemail_success','s:122:\"O seu endereço de correio eletrónico foi confirmado.\nPode agora [[Special:UserLogin|autenticar-se]] e desfrutar da wiki.\";'),('pt','messages:confirmemail_loggedin','s:54:\"O seu endereço de correio eletrónico foi confirmado.\";'),('pt','messages:confirmemail_subject','s:65:\"Confirmação de endereço de correio eletrónico da {{SITENAME}}\";'),('pt','messages:confirmemail_body','s:472:\"Alguém, provavelmente você a partir do endereço IP $1,\nregistou uma conta \"$2\" com este endereço de correio eletrónico em {{SITENAME}}.\n\nPara confirmar que esta conta é realmente sua e ativar\nas funcionalidades de correio eletrónico em {{SITENAME}}, abra a seguinte ligação no seu navegador:\n\n$3\n\nSe a conta *não* é sua, abra a seguinte ligação para cancelar a confirmação do endereço de correio eletrónico:\n\n$5\n\nEste código de confirmação expira a $4.\";'),('pt','messages:confirmemail_body_changed','s:484:\"Alguém, provavelmente você a partir do endereço IP $1,\nalterou o endereço de correio eletrónico da conta \"$2\" para este em {{SITENAME}}.\n\nPara confirmar que esta conta é realmente sua e reativar\nas funcionalidades de correio eletrónico em {{SITENAME}},\nabra o seguinte ligação no seu navegador:\n\n$3\n\nCaso a conta *não* lhe pertença, abra a seguinte ligação\npara cancelar a confirmação do endereço de correio eletrónico:\n\n$5\n\nEste código de confirmação expira a $4.\";'),('pt','messages:confirmemail_body_set','s:491:\"Alguém, provavelmente você a partir do endereço IP $1,\ndefiniu o seu endereço de correio eletrónico como correio da conta \"$2\" em {{SITENAME}}.\n\nPara confirmar que esta conta é realmente sua e reativar\nas funcionalidades de correio eletrónico em {{SITENAME}},\nabra a seguinte ligação no seu navegador:\n\n$3\n\nCaso a conta *não* lhe pertença, abra a seguinte ligação\npara cancelar a confirmação do endereço de correio eletrónico:\n\n$5\n\nEste código de confirmação expira a $4.\";'),('pt','messages:confirmemail_invalidated','s:59:\"Confirmação de endereço de correio eletrónico cancelada\";'),('pt','messages:invalidateemail','s:45:\"Cancelar confirmação do correio eletrónico\";'),('pt','messages:notificationemail_subject_changed','s:73:\"O endereço de correio eletrónico registado em {{SITENAME}} foi alterado\";'),('pt','messages:notificationemail_subject_removed','s:73:\"O endereço de correio eletrónico registado em {{SITENAME}} foi removido\";'),('pt','messages:notificationemail_body_changed','s:220:\"Alguém, provavelmente você, a partir do endereço IP $1, alterou o endereço de correio eletrónico da conta \"$2\" para \"$3\" em {{SITENAME}}.\n\nCaso não tenha alterado, contacte imediatamente um administrador do sítio.\";'),('pt','messages:notificationemail_body_removed','s:211:\"Alguém, provavelmente você, a partir do ender