pt','messages:expand_templates_generate_rawhtml','s:19:\"Mostrar o HTML puro\";'),('pt','messages:expand_templates_preview','s:23:\"Antevisão do resultado\";'),('pt','messages:expand_templates_preview_fail_html','s:481:\"<em>Devido ao fato de {{SITENAME}} possuir código HTML puro ativado e de ter havido perda de dados da sessão, a pré-visualização ficará oculta como precaução contra ataques por JavaScript.</em>\n\n<strong>Se esta é uma legítima tentativa de visualização, por favor tente novamente.</strong>\nCaso continue a não funcionar, tente [[Special:UserLogout|sair]] e voltar a entrar na sua conta, e verifique se o seu navegador permite a utilização de \'\'cookies\'\' deste sítio.\";'),('pt','messages:expand_templates_preview_fail_html_anon','s:328:\"<em>Devido ao fato de {{SITENAME}} possuir código HTML puro ativado e de não ter sessão iniciada, a pré-visualização ficará oculta como precaução contra ataques do JavaScript.</em>\n\n<strong>Se esta é uma legítima tentativa de visualização, por favor [[Especial:UserLogin|inicie sessão]] e tente novamente.</strong>\";'),('pt','messages:expand_templates_input_missing','s:56:\"Necessita de fornecer pelo menos algum texto de entrada.\";'),('pt','messages:pagelanguage','s:25:\"Alterar idioma da página\";'),('pt','messages:pagelang-name','s:7:\"Página\";'),('pt','messages:pagelang-language','s:6:\"Idioma\";'),('pt','messages:pagelang-use-default','s:25:\"Usar idioma pré-definido\";'),('pt','messages:pagelang-select-lang','s:17:\"Escolher o idioma\";'),('pt','messages:pagelang-submit','s:8:\"Submeter\";'),('pt','messages:right-pagelang','s:27:\"Alterar o idioma da página\";'),('pt','messages:action-pagelang','s:27:\"alterar o idioma da página\";'),('pt','messages:log-name-pagelang','s:32:\"Registo de alteração de idioma\";'),('pt','messages:log-description-pagelang','s:60:\"Este é um registo de alterações aos idiomas das páginas.\";'),('pt','messages:logentry-pagelang-pagelang','s:62:\"$1 {{GENDER:$2|alterou}} o idioma da página $3 de $4 para $5.\";'),('pt','messages:default-skin-not-found','s:1771:\"O tema padrão da sua wiki definido em <code dir=\"ltr\">$wgDefaultSkin</code>, <code>$1</code>, não está disponível.\n\nA instalação parece incluir {{PLURAL:$4|o seguinte tema|os seguintes temas}}. Consulte [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Configuração de Temas] para saber como {{PLURAL:$4|ativá-lo|ativá-los e escolher o tema padrão}}.\n\n$2\n\n; Se acabou de instalar o MediaWiki:\n: Provavelmente instalou-o a partir do git, ou diretamente do código fonte usando outro método. O comportamento é o esperado. Tente instalar temas a partir do [https://www.mediawiki.org/wiki/Category:All_skins diretório de temas da mediawiki.org], assim:\n:* Descarregue o  [https://www.mediawiki.org/wiki/Download tarball de instalação], que contém vários temas e extensões. Pode copiar o diretório <code>skins/</code> nele incluído.\n:* Descarregue tarballs de temas individuais, da [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Use o Git para descarregar temas].\n: Se é programador(a) do MediaWiki, isto não deverá interferir com o seu repositório git.\n\n; Se fez uma atualização do MediaWiki:\n: O MediaWiki 1.24 e versões mais recentes não ativam automaticamente os temas instalados (consulte [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Manual: Autodescoberta do Tema]). Pode copiar {{PLURAL:$5|a linha seguinte|as linhas seguintes}} para o ficheiro <code>LocalSettings.php</code> para ativar {{PLURAL:$5|o tema instalado|os temas instalados}}:\n\n<pre dir=\"ltr\">$3</pre>\n\n; Se acabou de modificar o <code>LocalSettings.php</code>:\n: Verifique cuidadosamente se o nome de cada tema está bem soletrado.\";'),('pt','messages:default-skin-not-found-no-skins','s:1240:\"O tema padrão da sua wiki definido em <code dir=\"ltr\">$wgDefaultSkin</code>, <code>$1</code>, não está disponível.\n\nNão tem nenhum tema instalado.\n\n; Se acabou de instalar ou atualizar o MediaWiki:\n: Provavelmente instalou-o a partir do git, ou diretamente do código fonte usando outro método. O comportamento é o esperado. O MediaWiki 1.24 e versões mais recentes não incluem qualquer tema no repositório principal. Tente instalar temas a partir do [https://www.mediawiki.org/wiki/Category:All_skins diretório de temas da mediawiki.org], assim:\n:* Descarregue o  [https://www.mediawiki.org/wiki/Download tarball de instalação], que contém vários temas e extensões. Pode copiar o diretório <code>skins/</code> nele incluído.\n:* Descarregue tarballs de temas individuais, da [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Use o Git para descarregar temas].\n: Se é programador(a) do MediaWiki, isto não deverá interferir com o seu repositório git. Consulte [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Configuração de Temas] para saber como ativar temas e escolher o tema padrão.\";'),('pt','messages:default-skin-not-found-row-enabled','s:32:\"* <code>$1</code> / $2 (ativado)\";'),('pt','messages:default-skin-not-found-row-disabled','s:52:\"* <code>$1</code> / $2 (<strong>desativado</strong>)\";'),('pt','messages:mediastatistics','s:25:\"Estatísticas multimédia\";'),('pt','messages:mediastatistics-summary','s:151:\"Estatísticas sobre os tipos de ficheiros carregados. Inclui apenas a versão mais recente do ficheiro. Versões antigas ou eliminadas são excluídas.\";'),('pt','messages:mediastatistics-nbytes','s:40:\"{{PLURAL:$1|$1 byte|$1 bytes}} ($2; $3%)\";'),('pt','messages:mediastatistics-bytespertype','s:87:\"Tamanho total de ficheiro para este secção: {{PLURAL:$1|$1 byte|$1 bytes}} ($2; $3%).\";'),('pt','messages:mediastatistics-allbytes','s:87:\"Tamanho total de ficheiro para todos os ficheiros: {{PLURAL:$1|$1 byte|$1 bytes}} 