i-main-links\">\n* [[mw:API:Main_page|Documentação]]\n* [[mw:API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Lista de discussão]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce Anúncios da API]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Erros e solicitações]\n</div>\n<strong>Estado:</strong> Todas as funcionalidades mostradas nesta página deveriam estar a funcionar, mas a API ainda está em desenvolvimento ativo, e pode ser alterada a qualquer momento. Inscreva-se na [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ lista de discussão mediawiki-api-announce] para ser informado acerca das atualizações.\n\n<strong>Pedidos incorretos:</strong> Quando são enviados pedidos incorretos à API, um cabeçalho de HTTP será enviado com a chave \"MediaWiki-API-Error\" e, em seguida, tanto o valor do cabeçalho quanto o código de erro retornado serão definidos com o mesmo valor. Para mais informação, consulte [[mw:API:Errors_and_warnings|API: Errors and warnings]].\n\n<strong>Testes:</strong> Para facilitar os testes de pedidos à API, consulte [[Special:ApiSandbox]].\";'),('pt','messages:apihelp-main-param-action','s:24:\"Qual acção a executar.\";'),('pt','messages:apihelp-main-param-format','s:20:\"O formato de saída.\";'),('pt','messages:apihelp-main-param-origin','s:1102:\"Ao aceder à API usando um pedido AJAX entre domínios (CORS), coloque aqui o domínio de origem. Isto tem de ser incluído em todas as verificações prévias, e portanto tem de fazer parte da URI do pedido (e não do conteúdo do POST).\n\nPara pedidos autenticados, este valor tem de corresponder de forma exata a um dos cabeçalhos <code>Origin</code>, portanto tem de ser algo como <kbd>https://en.wikipedia.org</kbd> ou <kbd>https://meta.wikimedia.org</kbd>. Se este parâmetro não for igual ao cabeçalho <code>Origin</code>, será devolvida a resposta 403. Se este parâmetro for igual ao cabeçalho <code>Origin</code> e a origem for permitida (<i>white-listed</i>) os cabeçalhos <code>Access-Control-Allow-Origin</code> e <code>Access-Control-Allow-Credentials</code> serão preenchidos.\n\nPara pedidos não autenticados, especifique o valor <kbd>*</kbd>. Isto fará com que o cabeçalho <code>Access-Control-Allow-Origin</code>\nseja preenchido, mas <code>Access-Control-Allow-Credentials</code> terá o valor <code>false</code> e todos os dados específicos do utilizador serão restringidos.\";'),('pt','messages:apihelp-block-description','s:23:\"Bloquear um utilizador.\";'),('pt','messages:apihelp-block-param-user','s:69:\"Nome de utilizador(a), endereço ou gama de IP que pretende bloquear.\";'),('pt','messages:apihelp-block-param-reason','s:19:\"Motivo do bloqueio.\";'),('pt','messages:apihelp-block-param-nocreate','s:28:\"Impedir criação de contas.\";'),('pt','messages:apihelp-createaccount-description','s:21:\"Criar uma nova conta.\";'),('pt','messages:apihelp-createaccount-param-name','s:22:\"Nome de utilizador(a).\";'),('pt','messages:apihelp-createaccount-param-email','s:58:\"Endereço de correio eletrónico do utilizador (opcional).\";'),('pt','messages:apihelp-createaccount-param-realname','s:41:\"Nome verdadeiro do utilizador (opcional).\";'),('pt','messages:apihelp-delete-description','s:21:\"Eliminar uma página.\";'),('pt','messages:apihelp-delete-param-watch','s:61:\"Adicionar a página à lista de vigiadas do utilizador atual.\";'),('pt','messages:apihelp-delete-param-unwatch','s:59:\"Remover a página da lista de vigiadas do utilizador atual.\";'),('pt','messages:apihelp-delete-example-simple','s:30:\"Eliminar <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-disabled-description','s:25:\"O módulo foi desativado.\";'),('pt','messages:apihelp-edit-description','s:24:\"Criar e editar páginas.\";'),('pt','messages:apihelp-edit-param-sectiontitle','s:30:\"Título para uma nova seção.\";'),('pt','messages:apihelp-edit-param-text','s:21:\"Conteúdo da página.\";'),('pt','messages:apihelp-edit-param-min