elp-userrights-param-add','s:38:\"Adicionar o utilizador a estes grupos.\";'),('pt','messages:apihelp-userrights-param-remove','s:38:\"Remover este utilizador destes grupos.\";'),('pt','messages:apihelp-watch-example-unwatch','s:56:\"Deixar de vigiar a página <kbd>Página Principal</kbd>.\";'),('pt','messages:apihelp-json-description','s:32:\"Dados de saída em formato JSON.\";'),('pt','messages:api-help-title','s:22:\"Ajuda API da MediaWiki\";'),('pt','messages:api-help-lead','s:141:\"Esta é uma página de documentação API do MediaWiki gerada automaticamente.\n\nDocumentação e exemplos: https://www.mediawiki.org/wiki/API\";'),('pt','messages:api-help-main-header','s:17:\"Módulo principal\";'),('pt','messages:api-help-flag-deprecated','s:28:\"Este módulo está obsoleto.\";'),('pt','messages:api-help-flag-readrights','s:40:\"Este módulo requer direitos de leitura.\";'),('pt','messages:api-help-flag-writerights','s:40:\"Este módulo requer direitos de leitura.\";'),('pt','messages:api-help-flag-mustbeposted','s:48:\"Este módulo aceita somente solicitações POST.\";'),('pt','messages:api-help-source','s:9:\"Fonte: $1\";'),('pt','messages:api-help-license','s:19:\"Licença: [[$1|$2]]\";'),('pt','messages:api-help-license-noname','s:30:\"Licença: [[$1|Ver ligação]]\";'),('pt','messages:api-help-license-unknown','s:59:\"Licença: <span class=\"apihelp-unknown\">desconhecida</span>\";'),('pt','messages:api-help-parameters','s:37:\"{{PLURAL:$1|Parâmetro|Parâmetros}}:\";'),('pt','messages:api-help-param-deprecated','s:9:\"Obsoleto.\";'),('pt','messages:api-help-param-required','s:32:\"Este parâmetro é obrigatório.\";'),('pt','messages:api-help-datatypes-header','s:13:\"Tipo de dados\";'),('pt','messages:api-help-datatypes','s:1958:\"Alguns tipos de parâmetro na API necessitam de mais explicações:\n;boolean\n:Os parâmetros booleanos funcionam como as caixas de seleção HTML: se o parâmetro for especificado, independentemente do valor, é considerado verdadeiro. Para um valor falso, omitir o parâmetro completo.\n;timestamp\n:Timestamps podem ser especificados em vários formatos. Formato de data e hora ISO 8601 é recomendado. Todos os horários estão em UTC, qualquer inclusão de fuso horário é ignorado.\n:* Data e hora ISO 8601, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd> (pontuação e <kbd>Z</kbd> são opcionais)\n:* Data e hora ISO 8601 com segundos fracionários (ignorado), <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>.<var>00001</var>Z</kbd> (traços, dois pontos e <kbd>Z</kbd> são opcionais)\n:* Formato do MediaWiki, <kbd><var>2001</var><var>01</var><var>15</var><var>14</var><var>56</var><var>00</var></kbd>\n:* Formato numérico genérico, <kbd><var>2001</var>-<var>01</var>-<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd> (fuso horário opcional do <kbd>GMT</kbd>, <kbd>+<var>##</var></kbd>, or <kbd>-<var>##</var></kbd> são ignorados)\n:* Formato EXIF, <kbd><var>2001</var>:<var>01</var>:<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:*Formato RFC 2822 (o fuso horário pode ser omitido), <kbd><var>Mon</var>, <var>15</var> <var>Jan</var> <var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Formato RFC 850 (o fuso horário pode ser omitido), <kbd><var>Monday</var>, <var>15</var>-<var>Jan</var>-<var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Formato C ctime, <kbd><var>Mon</var> <var>Jan</var> <var>15</var> <var>14</var>:<var>56</var>:<var>00</var> <var>2001</var></kbd>\n:* Segundos desde 1970-01-01T00:00:00Z como um inteiro de 1 a 13 dígitos (excluindo <kbd>0</kbd>)\n:* A string <kbd>now</kbd>\";'),('pt','messages:api-help-param-type-limit','s:31:\"Tipo: inteiro ou <kbd>max</kbd>\";'),('pt','messages:api-help-param-type-boolean','s:64:\"Tipo: boolean ([[Special:ApiHelp/main#main/datatypes|detalhes]])\";'),('pt','messages:api-help-param-type-user','s:73:\"Tipo: {{PLURAL:$1|1=nome de utilizador|2=lis