erence, or specify <kbd>content</kbd> to use this wiki\'s content language.\";'),('pt','messages:apihelp-block-param-expiry','s:233:\"Expiry time. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If set to <kbd>infinite</kbd>, <kbd>indefinite</kbd>, or <kbd>never</kbd>, the block will never expire.\";'),('pt','messages:apihelp-block-param-noemail','s:95:\"Prevent user from sending email through the wiki. (Requires the <code>blockemail</code> right).\";'),('pt','messages:apihelp-block-param-allowusertalk','s:123:\"Allow the user to edit their own talk page (depends on <var>[[mw:Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).\";'),('pt','messages:apihelp-block-param-watchuser','s:53:\"Watch the user\'s or IP address\'s user and talk pages.\";'),('pt','messages:apihelp-changeauthenticationdata-description','s:48:\"Change authentication data for the current user.\";'),('pt','messages:apihelp-changeauthenticationdata-example-password','s:76:\"Attempt to change the current user\'s password to <kbd>ExamplePassword</kbd>.\";'),('pt','messages:apihelp-checktoken-description','s:104:\"Check the validity of a token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('pt','messages:apihelp-checktoken-param-type','s:27:\"Type of token being tested.\";'),('pt','messages:apihelp-checktoken-param-token','s:14:\"Token to test.\";'),('pt','messages:apihelp-checktoken-param-maxtokenage','s:45:\"Maximum allowed age of the token, in seconds.\";'),('pt','messages:apihelp-checktoken-example-simple','s:45:\"Test the validity of a <kbd>csrf</kbd> token.\";'),('pt','messages:apihelp-clearhasmsg-description','s:57:\"Clears the <code>hasmsg</code> flag for the current user.\";'),('pt','messages:apihelp-clearhasmsg-example-1','s:56:\"Clear the <code>hasmsg</code> flag for the current user.\";'),('pt','messages:apihelp-clientlogin-description','s:46:\"Log in to the wiki using the interactive flow.\";'),('pt','messages:apihelp-clientlogin-example-login','s:112:\"Start the process of logging in to the wiki as user <kbd>Example</kbd> with password <kbd>ExamplePassword</kbd>.\";'),('pt','messages:apihelp-clientlogin-example-login2','s:129:\"Continue logging in after a <samp>UI</samp> response for two-factor auth, supplying an <var>OATHToken</var> of <kbd>987654</kbd>.\";'),('pt','messages:apihelp-compare-description','s:123:\"Get the difference between 2 pages.\n\nA revision number, a page title, or a page ID for both \"from\" and \"to\" must be passed.\";'),('pt','messages:apihelp-createaccount-param-preservestate','s:349:\"If <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> returned true for <samp>hasprimarypreservedstate</samp>, requests marked as <samp>primary-required</samp> should be omitted. If it returned a non-empty value for <samp>preservedusername</samp>, that username must be used for the <var>username</var> parameter.\";'),('pt','messages:apihelp-createaccount-example-create','s:95:\"Start the process of creating user <kbd>Example</kbd> with password <kbd>ExamplePassword</kbd>.\";'),('pt','messages:apihelp-createaccount-param-token','s:49:\"Account creation token obtained in first request.\";'),('pt','messages:apihelp-createaccount-param-mailpassword','s:67:\"If set to any value, a random password will be emailed to the user.\";'),('pt','messages:apihelp-createaccount-param-reason','s:63:\"Optional reason for creating the account to be put in the logs.\";'),('pt','messages:apihelp-createaccount-param-language','s:86:\"Language code to set as default for the user (optional, defaults to content language).\";'),('pt','messages:apihelp-createaccount-example-pass','s:65:\"Create user <kbd>testuser</kbd> with password <kbd>test123</kbd>.\";'),('pt','messages:apihelp-createaccount-example-mail','s:76:\"Create user <kbd>testmailuser</kbd> and email a randomly-generated password.\";'),('pt','messages:apihelp-cspreport-description','s:166:\"Used by browsers to report violations of the Content Security Policy. This module should never be used, except when used automatically by a CSP compliant web browser.\";'),('pt','messages:apihelp-cspreport-param-reportonly','s:71:\"Mark as being a report from a monitoring policy, not an enforced policy\";'),('pt','messages:apihelp-cspreport-param-source','s:56:\"What generated the CSP header that triggered this report\";'),('pt','messages:apihelp-delete-param-reason','s:84:\"Reason for the deletion. If not set, an automatically generated reason will be used.\";'),('pt','messages:apihelp-delete-param-tags','s:54:\"Change tags to apply to the entry in the deletion log.\";'),('pt','messages:apihelp-delete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('pt','messages:apihelp-delete-param-oldimage','s:134:\"The name of the old image to delete as provided by [[Special:ApiHelp/query+imageinfo|action=query&prop=imageinfo&iiprop=archivename]].\";'),('pt','messages:apihelp-delete-example-reason','s:74:\"Delete <kbd>Main Page</kbd> with the reason <kbd>Preparing for move</kbd>.\";'),('pt','messages:apihelp-edit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('pt','messages:apihelp-edit-param-summary','s:82:\"Edit summary. Also section title when $1section=new and $1sectiontitle is not set.\";'),('pt','messages:apihelp-edit-param-tags','s:37:\"Change tags to apply to the revision.\";'),('pt','messages:apihelp-edit-param-basetimestamp','s:168:\"Timestamp of the base revision, used to detect edit conflicts. May be obtained through [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]].\";'),('pt','messages:apihelp-edit-param-starttimestamp','s:242:\"Timestamp when the editing process began, used to detect edit conflicts. An appropriate value may be obtained using <var>[[Special:ApiHelp/main|curtimestamp]]</var> when beginning the edit process (e.g. when loading the page content to edit).\";'),('pt','messages:apihelp-edit-param-recreate','s:71:\"Override any errors about the page having been deleted in the meantime.\";'),('pt','messages:apihelp-edit-param-md5','s:159:\"The MD5 hash of the $1text parameter, or the $1prependtext and $1appendtext parameters concatenated. If set, the edit won\'t be done unless the hash is correct.\";'),('pt','messages:apihelp-edit-param-prependtext','s:61:\"Add this text to the beginning of the page. Overrides $1text.\";'),('pt','messages:apihelp-edit-param-appendtext','s:127:\"Add this text to the end of the page. Overrides $1text.\n\nUse $1section=new to append a new section, rather than this parameter.\";'),('pt','messages:apihelp-edit-param-undo','s:69:\"Undo this revision. Overrides $1text, $1prependtext and $1appendtext.\";'),('pt','messages:apihelp-edit-param-undoafter','s:79:\"Undo all revisions from $1undo to this one. If not set, just undo one revision.\";'),('pt','messages:apihelp-edit-param-redirect','s:32:\"Automatically resolve redirects.\";'),('pt','messages:apihelp-edit-param-token','s:94:\"The token should always be sent as the last parameter, or at least after the $1text parameter.\";'),('pt','messages:apihelp-edit-example-undo','s:52:\"Undo revisions 13579 through 13585 with autosummary.\";'),('pt','messages:apihelp-expandtemplates-param-revid','s:71:\"Revision ID, for <nowiki>{{REVISIONID}}</nowiki> and similar variables.\";'),('pt','messages:apihelp-expandtemplates-param-prop','s:158:\"Which pieces of information to get.\n\nNote that if no values are selected, the result will contain the wikitext, but the output will be in a deprecated format.\";'),('pt','messages:apihelp-expandtemplates-paramvalue-prop-categories','s:84:\"Any categories present in the input that are not represented in the wikitext output.\";'),('pt','messages:apihelp-expandtemplates-paramvalue-prop-properties','s:64:\"Page properties defined by expanded magic words in the wikitext.\";'),('pt','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:82:\"Whether the output is volatile and should not be reused elsewhere within the page.\";'),('pt','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:72:\"The maximum time after which caches of the result should be invalidated.\";'),('pt','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:203:\"Any ResourceLoader modules that parser functions have requested be added to the output. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('pt','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('pt','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('pt','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:32:\"The XML parse tree of the input.\";'),('pt','messages:apihelp-expandtemplates-param-includecomments','s:47:\"Whether to include HTML comments in the output.\";'),('pt','messages:apihelp-expandtemplates-param-generatexml','s:55:\"Generate XML parse tree (replaced by $1prop=parsetree).\";'),('pt','messages:apihelp-feedcontributions-param-user','s:40:\"What users to get the contributions for.\";'),('pt','messages:apihelp-feedcontributions-example-simple','s:49:\"Return contributions for user <kbd>Example</kbd>.\";'),('pt','messages:apihelp-feedrecentchanges-param-associated','s:44:\"Include associated (talk or main) namespace.\";'),('pt','messages:apihelp-feedrecentchanges-param-days','s:29:\"Days to limit the results to.\";'),('pt','messages:apihelp-feedrecentchanges-param-hideanons','s:37:\"Hide changes made by anonymous users.\";'),('pt','messages:apihelp-feedrecentchanges-param-hideliu','s:38:\"Hide changes made by registered users.\";'),('pt','messages:apihelp-feedrecentchanges-param-hidecategorization','s:33:\"Hide category membership changes.\";'),('pt','messages:apihelp-feedrecentchanges-param-showlinkedto','s:58:\"Show changes on pages linked to the selected page instead.\";'),('pt','messages:apihelp-feedrecentchanges-param-categories','s:54:\"Show only changes on pages in all of these categories.\";'),('pt','messages:apihelp-feedrecentchanges-param-categories_any','s:60:\"Show only changes on pages in any of the categories instead.\";'),('pt','messages:apihelp-feedwatchlist-example-all6hrs','s:54:\"Show all changes to watched pages in the past 6 hours.\";'),('pt','messages:apihelp-help-param-modules','s:159:\"Modules to display help for (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),('pt','messages:apihelp-help-example-submodules','s:56:\"Help for <kbd>action=query</kbd> and all its submodules.\";'),('pt','messages:apihelp-help-example-query','s:30:\"Help for two query submodules.\";'),('pt','messages:apihelp-import-description','s:195:\"Import a page from another wiki, or from an XML file.\n\nNote that the HTTP POST must be done as a file upload (i.e. using multipart/form-data) when sending a file for the <var>xml</var> parameter.\";'),('pt','messages:apihelp-import-param-interwikisource','s:43:\"For interwiki imports: wiki to import from.\";'),('pt','messages:apihelp-import-param-interwikipage','s:38:\"For interwiki imports: page to import.\";'),('pt','messages:apihelp-import-param-fullhistory','s:77:\"For interwiki imports: import the full history, not just the current version.\";'),('pt','messages:apihelp-import-param-templates','s:61:\"For interwiki imports: import all included templates as well.\";'),('pt','messages:apihelp-import-example-import','s:72:\"Import [[meta:Help:ParserFunctions]] to namespace 100 with full history.\";'),('pt','messages:apihelp-linkaccount-description','s:64:\"Link an account from a third-party provider to the current user.\";'),('pt','messages:apihelp-linkaccount-example-link','s:67:\"Start the process of linking to an account from <kbd>Example</kbd>.\";'),('pt','messages:apihelp-login-description','s:293:\"Log in and get authentication cookies.\n\nThis action should only be used in combination with [[Special:BotPasswords]]; use for main-account login is deprecated and may fail without warning. To safely log in to the main account, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('pt','messages:apihelp-login-description-nobotpasswords','s:180:\"Log in and get authentication cookies.\n\nThis action is deprecated and may fail without warning. To safely log in, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('pt','messages:apihelp-login-param-token','s:38:\"Login token obtained in first request.\";'),('pt','messages:apihelp-login-example-gettoken','s:23:\"Retrieve a login token.\";'),('pt','messages:apihelp-logout-example-logout','s:25:\"Log the current user out.\";'),('pt','messages:apihelp-managetags-param-operation','s:379:\"Which operation to perform:\n;create:Create a new change tag for manual use.\n;delete:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\n;activate:Activate a change tag, allowing users to apply it manually.\n;deactivate:Deactivate a change tag, preventing users from applying it manually.\";'),('pt','messages:apihelp-managetags-param-tag','s:277:\"Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),('pt','messages:apihelp-managetags-param-ignorewarnings','s:68:\"Whether to ignore any warnings that are issued during the operation.\";'),('pt','messages:apihelp-managetags-example-create','s:88:\"Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('pt','messages:apihelp-managetags-example-delete','s:71:\"Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),('pt','messages:apihelp-managetags-example-activate','s:90:\"Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('pt','messages:apihelp-managetags-example-deactivate','s:84:\"Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),('pt','messages:apihelp-mergehistory-description','s:21:\"Merge page histories.\";'),('pt','messages:apihelp-mergehistory-param-from','s:102:\"Title of the page from which history will be merged. Cannot be used together with <var>$1fromid</var>.\";'),('pt','messages:apihelp-mergehistory-param-fromid','s:102:\"Page ID of the page from which history will be merged. Cannot be used together with <var>$1from</var>.\";'),('pt','messages:apihelp-mergehistory-param-to','s:98:\"Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),('pt','messages:apihelp-mergehistory-param-toid','s:98:\"Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),('pt','messages:apihelp-mergehistory-param-timestamp','s:208:\"Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),('pt','messages:apihelp-mergehistory-param-reason','s:29:\"Reason for the history merge.\";'),('pt','messages:apihelp-mergehistory-example-merge','s:71:\"Merge the entire history of <kbd>Oldpage</kbd> into <kbd>Newpage</kbd>.\";'),('pt','messages:apihelp-mergehistory-example-merge-timestamp','s:116:\"Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),('pt','messages:apihelp-move-param-to','s:28:\"Title to rename the page to.\";'),('pt','messages:apihelp-move-param-reason','s:22:\"Reason for the rename.\";'),('pt','messages:apihelp-move-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('pt','messages:apihelp-move-example-move','s:76:\"Move <kbd>Badtitle</kbd> to <kbd>Goodtitle</kbd> without leaving a redirect.\";'),('pt','messages:apihelp-opensearch-description','s:46:\"Search the wiki using the OpenSearch protocol.\";'),('pt','messages:apihelp-opensearch-param-suggest','s:102:\"Do nothing if <var>[[mw:Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> is false.\";'),('pt','messages:apihelp-opensearch-param-redirects','s:231:\"How to handle redirects:\n;return:Return the redirect itself.\n;resolve:Return the target page. May return fewer than $1limit results.\nFor historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),('pt','messages:apihelp-opensearch-param-warningsaserror','s:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),('pt','messages:apihelp-options-description','s:224:\"Change preferences of the current user.\n\nOnly options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('pt','messages:apihelp-options-param-resetkinds','s:76:\"List of types of options to reset when the <var>$1reset</var> option is set.\";'),('pt','messages:apihelp-options-param-change','s:358:\"List of changes, formatted name=value (e.g. skin=vector). If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value. If any value passed contains the pipe character (<kbd>|</kbd>), use the [[Special:ApiHelp/main#main/datatypes|alternative multiple-value separator]] for correct operation.\";'),('pt','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),('pt','messages:apihelp-options-param-optionvalue','s:62:\"The value for the option specified by <var>$1optionname</var>.\";'),('pt','messages:apihelp-options-example-change','s:60:\"Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),('pt','messages:apihelp-paraminfo-param-modules','s:241:\"List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>, or all submodules with <kbd>+*</kbd>, or all submodules recursively with <kbd>+**</kbd>.\";'),('pt','messages:apihelp-paraminfo-param-helpformat','s:23:\"Format of help strings.\";'),('pt','messages:apihelp-paraminfo-param-querymodules','s:177:\"List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),('pt','messages:apihelp-paraminfo-param-mainmodule','s:97:\"Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),('pt','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),('pt','messages:apihelp-paraminfo-param-formatmodules','s:101:\"List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),('pt','messages:apihelp-paraminfo-example-1','s:269:\"Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('pt','messages:apihelp-paraminfo-example-2','s:82:\"Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('pt','messages:apihelp-parse-description','s:523:\"Parses content and returns parser output.\n\nSee the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('pt','messages:apihelp-parse-param-title','s:130:\"Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),('pt','messages:apihelp-parse-param-text','s:96:\"Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),('pt','messages:apihelp-parse-param-redirects','s:77:\"If <var>$1page</var> or <var>$1pageid</var> is set to a redirect, resolve it.\";'),('pt','messages:apihelp-parse-param-oldid','s:88:\"Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),('pt','messages:apihelp-parse-paramvalue-prop-revid','s:40:\"Adds the revision ID of the parsed page.\";'),('pt','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Adds the title of the parsed wikitext.\";'),('pt','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('pt','messages:apihelp-parse-paramvalue-prop-parsetree','s:79:\"The XML parse tree of revision content (requires content model <code>$1</code>)\";'),('pt','messages:apihelp-parse-param-pst','s:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('pt','messages:apihelp-parse-param-onlypst','s:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('pt','messages:apihelp-parse-param-effectivelanglinks','s:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('pt','messages:apihelp-parse-param-sectiontitle','s:151:\"New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),('pt','messages:apihelp-parse-param-disablelimitreport','s:68:\"Omit the limit report (\"NewPP limit report\") from the parser output.\";'),('pt','messages:apihelp-parse-param-disablepp','s:44:\"Use <var>$1disablelimitreport</var> instead.\";'),('pt','messages:apihelp-parse-param-disableeditsection','s:47:\"Omit edit section links from the parser output.\";'),('pt','messages:apihelp-parse-param-disabletidy','s:57:\"Do not run HTML cleanup (e.g. tidy) on the parser output.\";'),('pt','messages:apihelp-parse-param-generatexml','s:106:\"Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),('pt','messages:apihelp-parse-param-preview','s:22:\"Parse in preview mode.\";'),('pt','messages:apihelp-parse-param-sectionpreview','s:57:\"Parse in section preview mode (enables preview mode too).\";'),('pt','messages:apihelp-parse-param-disabletoc','s:33:\"Omit table of contents in output.\";'),('pt','messages:apihelp-parse-param-contentformat','s:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),('pt','messages:apihelp-parse-param-contentmodel','s:159:\"Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),('pt','messages:apihelp-patrol-param-tags','s:52:\"Change tags to apply to the entry in the patrol log.\";'),('pt','messages:apihelp-protect-param-protections','s:262:\"List of protection levels, formatted <kbd>action=level</kbd> (e.g. <kbd>edit=sysop</kbd>). A level of <kbd>all</kbd> means everyone is allowed to take the action, i.e. no restriction.\n\n<strong>Note:</strong> Any actions not listed will have restrictions removed.\";'),('pt','messages:apihelp-protect-param-expiry','s:206:\"Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd>, for a never-expiring protection.\";'),('pt','messages:apihelp-protect-param-tags','s:56:\"Change tags to apply to the entry in the protection log.\";'),('pt','messages:apihelp-protect-param-cascade','s:160:\"Enable cascading protection (i.e. protect transcluded templates and images used in this page). Ignored if none of the given protection levels support cascading.\";'),('pt','messages:apihelp-protect-param-watch','s:73:\"If set, add the page being (un)protected to the current user\'s watchlist.\";'),('pt','messages:apihelp-protect-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('pt','messages:apihelp-purge-description','s:92:\"Purge the cache for the given titles.\n\nRequires a POST request if the user is not logged in.\";'),('pt','messages:apihelp-purge-example-simple','s:59:\"Purge the <kbd>Main Page</kbd> and the <kbd>API</kbd> page.\";'),('pt','messages:apihelp-purge-example-generator','s:47:\"Purge the first 10 pages in the main namespace.\";'),('pt','messages:apihelp-query-description','s:147:\"Fetch data from and about MediaWiki.\n\nAll data modifications will first have to use query to acquire a token to prevent abuse from malicious sites.\";'),('pt','messages:apihelp-query-param-indexpageids','s:68:\"Include an additional pageids section listing all returned page IDs.\";'),('pt','messages:apihelp-query-param-export','s:61:\"Export the current revisions of all given or generated pages.\";'),('pt','messages:apihelp-query-param-exportnowrap','s:127:\"Return the export XML without wrapping it in an XML result (same format as [[Special:Export]]). Can only be used with $1export.\";'),('pt','messages:apihelp-query-param-iwurl','s:62:\"Whether to get the full URL if the title is an interwiki link.\";'),('pt','messages:apihelp-query-param-rawcontinue','s:61:\"Return raw <samp>query-continue</samp> data for continuation.\";'),('pt','messages:apihelp-query-example-revisions','s:125:\"Fetch [[Special:ApiHelp/query+siteinfo|site info]] and [[Special:ApiHelp/query+revisions|revisions]] of <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-query-example-allpages','s:56:\"Fetch revisions of pages beginning with <kbd>API/</kbd>.\";'),('pt','messages:apihelp-query+allcategories-param-from','s:39:\"The category to start enumerating from.\";'),('pt','messages:apihelp-query+allcategories-param-to','s:36:\"The category to stop enumerating at.\";'),('pt','messages:apihelp-query+allcategories-paramvalue-prop-size','s:37:\"Adds number of pages in the category.\";'),('pt','messages:apihelp-query+allcategories-paramvalue-prop-hidden','s:72:\"Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('pt','messages:apihelp-query+allcategories-example-generator','s:86:\"Retrieve info about the category page itself for categories beginning <kbd>List</kbd>.\";'),('pt','messages:apihelp-query+alldeletedrevisions-param-miser-user-namespace','s:256:\"<strong>Note:</strong> Due to [[mw:Manual:$wgMiserMode|miser mode]], using <var>$1user</var> and <var>$1namespace</var> together may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('pt','messages:apihelp-query+alldeletedrevisions-param-generatetitles','s:73:\"When being used as a generator, generate titles rather than revision IDs.\";'),('pt','messages:apihelp-query+allfileusages-param-prefix','s:54:\"Search for all file titles that begin with this value.\";'),('pt','messages:apihelp-query+allfileusages-param-unique','s:134:\"Only show distinct file titles. Cannot be used with $1prop=ids.\nWhen used as a generator, yields target pages instead of source pages.\";'),('pt','messages:apihelp-query+allfileusages-param-prop','s:39:\"Which pieces of information to include:\";'),('pt','messages:apihelp-query+allfileusages-paramvalue-prop-ids','s:68:\"Adds the page IDs of the using pages (cannot be used with $1unique).\";'),('pt','messages:apihelp-query+allfileusages-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+allfileusages-example-B','s:96:\"List file titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('pt','messages:apihelp-query+allfileusages-example-unique-generator','s:47:\"Gets all file titles, marking the missing ones.\";'),('pt','messages:apihelp-query+allimages-description','s:34:\"Enumerate all images sequentially.\";'),('pt','messages:apihelp-query+allimages-param-sort','s:20:\"Property to sort by.\";'),('pt','messages:apihelp-query+allimages-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+allimages-param-from','s:77:\"The image title to start enumerating from. Can only be used with $1sort=name.\";'),('pt','messages:apihelp-query+allimages-param-to','s:74:\"The image title to stop enumerating at. Can only be used with $1sort=name.\";'),('pt','messages:apihelp-query+allimages-param-start','s:80:\"The timestamp to start enumerating from. Can only be used with $1sort=timestamp.\";'),('pt','messages:apihelp-query+allimages-param-end','s:73:\"The timestamp to end enumerating. Can only be used with $1sort=timestamp.\";'),('pt','messages:apihelp-query+allimages-param-prefix','s:90:\"Search for all image titles that begin with this value. Can only be