</kbd>.\";'),('pt','messages:apihelp-query+categorymembers-param-prop','s:39:\"Which pieces of information to include:\";'),('pt','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('pt','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('pt','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:71:\"Adds the sortkey used for sorting in the category (hexadecimal string).\";'),('pt','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:94:\"Adds the sortkey prefix used for sorting in the category (human-readable part of the sortkey).\";'),('pt','messages:apihelp-query+categorymembers-paramvalue-prop-type','s:114:\"Adds the type that the page has been categorised as (<samp>page</samp>, <samp>subcat</samp> or <samp>file</samp>).\";'),('pt','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:49:\"Adds the timestamp of when the page was included.\";'),('pt','messages:apihelp-query+categorymembers-param-namespace','s:166:\"Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('pt','messages:apihelp-query+categorymembers-param-type','s:91:\"Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('pt','messages:apihelp-query+categorymembers-param-limit','s:38:\"The maximum number of pages to return.\";'),('pt','messages:apihelp-query+categorymembers-param-sort','s:20:\"Property to sort by.\";'),('pt','messages:apihelp-query+categorymembers-param-dir','s:27:\"In which direction to sort.\";'),('pt','messages:apihelp-query+categorymembers-param-start','s:83:\"Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('pt','messages:apihelp-query+categorymembers-param-end','s:79:\"Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('pt','messages:apihelp-query+categorymembers-param-starthexsortkey','s:121:\"Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('pt','messages:apihelp-query+categorymembers-param-endhexsortkey','s:117:\"Sortkey to end listing at, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('pt','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:126:\"Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('pt','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:192:\"Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('pt','messages:apihelp-query+categorymembers-param-startsortkey','s:30:\"Use $1starthexsortkey instead.\";'),('pt','messages:apihelp-query+categorymembers-param-endsortkey','s:28:\"Use $1endhexsortkey instead.\";'),('pt','messages:apihelp-query+categorymembers-example-simple','s:50:\"Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('pt','messages:apihelp-query+categorymembers-example-generator','s:66:\"Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('pt','messages:apihelp-query+contributors-description','s:89:\"Get the list of logged-in contributors and the count of anonymous contributors to a page.\";'),('pt','messages:apihelp-query+contributors-param-group','s:121:\"Only include users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('pt','messages:apihelp-query+contributors-param-excludegroup','s:116:\"Exclude users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('pt','messages:apihelp-query+contributors-param-rights','s:143:\"Only include users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('pt','messages:apihelp-query+contributors-param-excluderights','s:138:\"Exclude users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('pt','messages:apihelp-query+contributors-example-simple','s:51:\"Show contributors to the page <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-query+deletedrevisions-description','s:271:\"Get deleted revision information.\n\nMay be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('pt','messages:apihelp-query+deletedrevisions-param-start','s:88:\"The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('pt','messages:apihelp-query+deletedrevisions-param-end','s:85:\"The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('pt','messages:apihelp-query+deletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('pt','messages:apihelp-query+deletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('pt','messages:apihelp-query+deletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('pt','messages:apihelp-query+deletedrevisions-example-titles','s:105:\"List the deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content.\";'),('pt','messages:apihelp-query+deletedrevisions-example-revids','s:60:\"List the information for deleted revision <kbd>123456</kbd>.\";'),('pt','messages:apihelp-query+deletedrevs-description','s:403:\"List deleted revisions.\n\nOperates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('pt','messages:apihelp-query+deletedrevs-param-start','s:40:\"The timestamp to start enumerating from.\";'),('pt','messages:apihelp-query+deletedrevs-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('pt','messages:apihelp-query+deletedrevs-param-from','s:28:\"Start listing at this title.\";'),('pt','messages:apihelp-query+deletedrevs-param-to','s:27:\"Stop listing at this title.\";'),('pt','messages:apihelp-query+deletedrevs-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('pt','messages:apihelp-query+deletedrevs-param-unique','s:37:\"List only one revision for each page.\";'),('pt','messages:apihelp-query+deletedrevs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('pt','messages:apihelp-query+deletedrevs-param-user','s:33:\"Only list revisions by this user.\";'),('pt','messages:apihelp-query+deletedrevs-param-limit','s:40:\"The maximum amount of revisions to list.\";'),('pt','messages:apihelp-query+deletedrevs-param-prop','s:628:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the ID of the user who made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('pt','messages:apihelp-query+deletedrevs-example-mode1','s:119:\"List the last deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('pt','messages:apihelp-query+deletedrevs-example-mode2','s:66:\"List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('pt','messages:apihelp-query+deletedrevs-example-mode3-main','s:67:\"List the first 50 deleted revisions in the main namespace (mode 3).\";'),('pt','messages:apihelp-query+deletedrevs-example-mode3-talk','s:70:\"List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('pt','messages:apihelp-query+disabled-description','s:36:\"This query module has been disabled.\";'),('pt','messages:apihelp-query+duplicatefiles-description','s:75:\"List all files that are duplicates of the given files based on hash values.\";'),('pt','messages:apihelp-query+duplicatefiles-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+duplicatefiles-param-localonly','s:44:\"Look only for files in the local repository.\";'),('pt','messages:apihelp-query+duplicatefiles-example-simple','s:58:\"Look for duplicates of [[:File:Albert Einstein Head.jpg]].\";'),('pt','messages:apihelp-query+duplicatefiles-example-generated','s:33:\"Look for duplicates of all files.\";'),('pt','messages:apihelp-query+embeddedin-description','s:55:\"Find all pages that embed (transclude) the given title.\";'),('pt','messages:apihelp-query+embeddedin-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+extlinks-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('pt','messages:apihelp-query+extlinks-param-query','s:107:\"Search string without protocol. Useful for checking whether a certain page contains a certain external url.\";'),('pt','messages:apihelp-query+extlinks-param-expandurl'