"SHA1 hash of image. Overrides $1sha1base36.\";'),('pt','messages:apihelp-query+filearchive-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('pt','messages:apihelp-query+filearchive-param-prop','s:31:\"Which image information to get:\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-sha1','s:30:\"Adds SHA-1 hash for the image.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-timestamp','s:40:\"Adds timestamp for the uploaded version.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-user','s:41:\"Adds user who uploaded the image version.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-size','s:89:\"Adds the size of the image in bytes and the height, width and page count (if applicable).\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-description','s:38:\"Adds description of the image version.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-parseddescription','s:37:\"Parse the description of the version.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-mime','s:23:\"Adds MIME of the image.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-mediatype','s:33:\"Adds the media type of the image.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-metadata','s:49:\"Lists Exif metadata for the version of the image.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-bitdepth','s:34:\"Adds the bit depth of the version.\";'),('pt','messages:apihelp-query+filearchive-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('pt','messages:apihelp-query+filerepoinfo-description','s:72:\"Return meta information about image repositories configured on the wiki.\";'),('pt','messages:apihelp-query+filerepoinfo-param-prop','s:490:\"Which repository properties to get (ther