,'s:45:\"Adds the user who uploaded each file version.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-userid','s:55:\"Add the ID of the user that uploaded each file version.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:23:\"Comment on the version.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:33:\"Parse the comment on the version.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:37:\"Adds the canonical title of the file.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-url','s:47:\"Gives URL to the file and the description page.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:88:\"Adds the size of the file in bytes and the height, width and page count (if applicable).\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:29:\"Adds SHA-1 hash for the file.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:27:\"Adds MIME type of the file.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:74:\"Adds MIME type of the image thumbnail (requires url and param $1urlwidth).\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:32:\"Adds the media type of the file.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:48:\"Lists Exif metadata for the version of the file.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:63:\"Lists file format generic metadata for the version of the file.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:84:\"Lists formatted metadata combined from multiple sources. Results are HTML formatted.\";'),('pt','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('pt','messag