ages:apihelp-query+imageinfo-example-simple','s:82:\"Fetch information about the current version of [[:File:Albert Einstein Head.jpg]].\";'),('pt','messages:apihelp-query+imageinfo-example-dated','s:75:\"Fetch information about versions of [[:File:Test.jpg]] from 2008 and later.\";'),('pt','messages:apihelp-query+images-description','s:47:\"Returns all files contained on the given pages.\";'),('pt','messages:apihelp-query+images-param-images','s:85:\"Only list these files. Useful for checking whether a certain page has a certain file.\";'),('pt','messages:apihelp-query+images-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+images-example-simple','s:46:\"Get a list of files used in the [[Main Page]].\";'),('pt','messages:apihelp-query+images-example-generator','s:58:\"Get information about all files used in the [[Main Page]].\";'),('pt','messages:apihelp-query+imageusage-description','s:46:\"Find all pages that use the given image title.\";'),('pt','messages:apihelp-query+imageusage-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+imageusage-param-filterredir','s:121:\"How to filter for redirects. If set to nonredirects when $1redirect is enabled, this is only applied to the second level.\";'),('pt','messages:apihelp-query+imageusage-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('pt','messages:apihelp-query+imageusage-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('pt','messages:apihelp-query+imageusage-example-simple','s:52:\"Show pages using [[:File:Albert Einstein Head.jpg]].\";'),('pt','messages:apihelp-query+imageusage-example-generator','s:69:\"Get information about pages using [[:File:Albert Einstein Head.jpg]].\";'),('pt','messages:apihelp-query+info-param-prop','s:35:\"Which additional properties to get:\";'),('pt','messages:apihelp-query+info-paramvalue-prop-protection','s:39:\"List the protection level of each page.\";'),('pt','messages:apihelp-query+info-paramvalue-prop-talkid','s:52:\"The page ID of the talk page for each non-talk page.\";'),('pt','messages:apihelp-query+info-paramvalue-prop-watched','s:37:\"List the watched status of each page.\";'),('pt','messages:apihelp-query+info-paramvalue-prop-watchers','s:35:\"The number of watchers, if allowed.\";'),('pt','messages:apihelp-query+info-paramvalue-prop-visitingwatchers','s:91:\"The number of watchers of each page who have visited recent edits to that page, if allowed.\";'),('pt','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:50:\"The watchlist notification timestamp of each page.\";'),('pt','messages:apihelp-query+info-paramvalue-prop-subjectid','s:50:\"The page ID of the parent page for each talk page.\";'),('pt','messages:apihelp-query+info-paramvalue-prop-url','s:67:\"Gives a full URL, an edit URL, and the canonical URL for each page.\";'),('pt','messages:apihelp-query+info-param-token','s:70:\"Use [[Special:ApiHelp/query+tokens|action=query&meta=tokens]] instead.\";'),('pt','messages:apihelp-query+info-example-protection','s:75:\"Get general and protection information about the page <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-query+iwbacklinks-param-title','s:70:\"Interwiki link to search for. Must be used with <var>$1blprefix</var>.\";'),('pt','messages:apihelp-query+iwbacklinks-param-prop','s:24:\"Which properties to get:\";'),('pt','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwprefix','s:33:\"Adds the prefix of the interwiki.\";'),('pt','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwtitle','s:32:\"Adds the title of the interwiki.\";'),('pt','messages:apihelp-query+iwbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+iwbacklinks-example-simple','s:40:\"Get pages linking to [[wikibooks:Test]].\";'),('pt','messages:apihelp-query+iwbacklinks-example-generator','s:58:\"Get information about pages linking to [[wikibooks:Test]].\";'),('pt','messages:apihelp-query+iwlinks-description','s:49:\"Returns all interwiki links from the given pages.\";'),('pt','messages:apihelp-query+iwlinks-param-url','s:57:\"Whether to get the full URL (cannot be used with $1prop).\";'),('pt','messages:apihelp-query+iwlinks-param-prop','s:63:\"Which additional properties to get for each interlanguage link:\";'),('pt','messages:apihelp-query+iwlinks-paramvalue-prop-url','s:18:\"Adds the full URL.\";'),('pt','messages:apihelp-query+iwlinks-param-limit','s:35:\"How many interwiki links to return.\";'),('pt','messages:apihelp-query+iwlinks-param-prefix','s:45:\"Only return interwiki links with this prefix.\";'),('pt','messages:apihelp-query+iwlinks-param-title','s:68:\"Interwiki link to search for. Must be used with <var>$1prefix</var>.\";'),('pt','messages:apihelp-query+iwlinks-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+iwlinks-example-simple','s:55:\"Get interwiki links from the page <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-query+langbacklinks-description','s:284:\"Find all pages that link to the given language link.\n\nCan be used to find all links with a language code, or all links to a title (with a given language). Using neither parameter is effectively \"all language links\".\n\nNote that this may not consider language links added by extensions.\";'),('pt','messages:apihelp-query+langbacklinks-param-lang','s:31:\"Language for the language link.\";'),('pt','messages:apihelp-query+langbacklinks-param-title','s:54:\"Language link to search for. Must be used with $1lang.\";'),('pt','messages:apihelp-query+langbacklinks-param-prop','s:24:\"Which properties to get:\";'),('pt','messages:apihelp-query+langbacklinks-paramvalue-prop-lllang','s:44:\"Adds the language code of the language 