se namespaces only.\";'),('pt','messages:apihelp-query+links-param-titles','s:101:\"Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('pt','messages:apihelp-query+links-param-dir','s:31:\"The direction in which to list.\";'),('pt','messages:apihelp-query+links-example-simple','s:44:\"Get links from the page <kbd>Main Page</kbd>\";'),('pt','messages:apihelp-query+links-example-generator','s:70:\"Get information about the link pages in the page <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-query+links-example-namespaces','s:95:\"Get links from the page <kbd>Main Page</kbd> in the {{ns:user}} and {{ns:template}} namespaces.\";'),('pt','messages:apihelp-query+linkshere-description','s:44:\"Find all pages that link to the given pages.\";'),('pt','messages:apihelp-query+linkshere-param-prop','s:24:\"Which properties to get:\";'),('pt','messages:apihelp-query+linkshere-paramvalue-prop-pageid','s:21:\"Page ID of each page.\";'),('pt','messages:apihelp-query+linkshere-paramvalue-prop-title','s:19:\"Title of each page.\";'),('pt','messages:apihelp-query+linkshere-paramvalue-prop-redirect','s:31:\"Flag if the page is a redirect.\";'),('pt','messages:apihelp-query+linkshere-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('pt','messages:apihelp-query+linkshere-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('pt','messages:apihelp-query+linkshere-example-simple','s:49:\"Get a list of pages linking to the [[Main Page]].\";'),('pt','messages:apihelp-query+linkshere-example-generator','s:57:\"Get information about pages linking to the [[Main Page]].\";'),('pt','messages:apihelp-query+logevents-description','s:21:\"Get events from logs.\";'),('pt','messages:apihelp-query+logevents-param-prop','s:24:\"Which properties to get:\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-ids','s:29:\"Adds the ID of the log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-title','s:45:\"Adds the title of the page for the log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-type','s:27:\"Adds the type of log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-user','s:44:\"Adds the user responsible for the log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-userid','s:55:\"Adds the user ID who was responsible for the log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-timestamp','s:37:\"Adds the timestamp for the log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-comment','s:34:\"Adds the comment of the log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-parsedcomment','s:41:\"Adds the parsed comment of the log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-details','s:45:\"Lists additional details about the log event.\";'),('pt','messages:apihelp-query+logevents-paramvalue-prop-tags','s:29:\"Lists tags for the log event.\";'),('pt','messages:apihelp-query+logevents-param-type','s:37:\"Filter log entries to only this type.\";'),('pt','messages:apihelp-query+logevents-param-action','s:210:\"Filter log actions to only this action. Overrides <var>$1type</var>. In the list of possible values, values with the asterisk wildcard such as <kbd>action/*</kbd> can have different strings after the slash (/).\";'),('pt','messages:apihelp-query+logevents-param-start','s:40:\"The timestamp to start enumerating from.\";'),('pt','messages:apihelp-query+logevents-param-end','s:33:\"The timestamp to end enumerating.\";'),('pt','messages:apihelp-query+logevents-param-user','s:47:\"Filter entries to those made by the given user.\";'),('pt','messages:apihelp-query+logevents-param-title','s:42:\"Filter entries to those related to a page.\";'),('pt','messages:apihelp-query+logevents-param-namespace','s:47:\"Filter entries to those in the given namespace.\";'),('pt','messages:apihelp-query+logevents-param-prefix','s:43:\"Filter entries that start with this prefix.\";'),('pt','messages:apihelp-query+logevents-param-tag','s:45:\"Only list event entries tagged with this tag.\";'),('pt','messages:apihelp-query+logevents-param-limit','s:39:\"How many total event entries to return.\";'),('pt','messages:apihelp-query+logevents-example-simple','s:23:\"List recent log events.\";'),('pt','messages:apihelp-query+pagepropnames-description','s:48:\"List all page property names in use on the wiki.\";'),('pt','messages:apihelp-query+pagepropnames-param-limit','s:38:\"The maximum number of names to return.\";'),('pt','messages:apihelp-query+pagepropnames-example-simple','s:28:\"Get first 10 property names.\";'),('pt','messages:apihelp-query+pageprops-description','s:56:\"Get various page properties defined in the page content.\";'),('pt','messages:apihelp-query+pageprops-param-prop','s:215:\"Only list these page properties (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use). Useful for checking whether pages use a certain page property.\";'),('pt','messages:apihelp-query+pageprops-example-simple','s:75:\"Get properties for the pages <kbd>Main Page</kbd> and <kbd>MediaWiki</kbd>.\";'),('pt','messages:apihelp-query+pageswithprop-description','s:43:\"List all pages using a given page property.\";'),('pt','messages:apihelp-query+pageswithprop-param-propname','s:163:\"Page property for which to enumerate pages (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use).\";'),('pt','messages:apihelp-query+pageswithprop-param-prop','s:39:\"Which pieces of information to include:\";'),('pt','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('pt','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('pt','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:36:\"Adds the value of the page property.\";'),('pt','messages:apihelp-query+pageswithprop-param-limit','s:38:\"The maximum number of pages to return.\";'),('pt','messages:apihelp-query+pageswithprop-param-dir','s:27:\"In which direction to sort.\";'),('pt','messages:apihelp-query+pageswithprop-example-simple','s:81:\"List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('pt','messages:apihelp-query+pageswithprop-example-generator','s:89:\"Get additional information about the first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('pt','messages:apihelp-query+prefixsearch-description','s:550:\"Perform a prefix search for page titles.\n\nDespite the similarity in names, this module is not intended to be equivalent to [[Special:PrefixIndex]]; for that, see <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> with the <kbd>apprefix</kbd> parameter. The purpose of this module is similar to <kbd>[[Special:ApiHelp/opensearch|action=opensearch]]</kbd>: to take user input and provide the best-matching titles. Depending on the search engine backend, this might include typo correction, redirect avoidance, or other heuristics.\";'),('pt','messages:apihelp-query+prefixsearch-param-search','s:14:\"Search string.\";'),('pt','messages:apihelp-query+prefixsearch-param-namespace','s:21:\"Namespaces to search.\";'),('pt','messages:apihelp-query+prefixsearch-param-offset','s:26:\"Number of results to skip.\";'),('pt','messages:apihelp-query+prefixsearch-example-simple','s:57:\"Search for page titles beginning with <kbd>meaning</kbd>.\";'),('pt','messages:apihelp-query+prefixsearch-param-profile','s:22:\"Search profile to use.\";'),('pt','messages:apihelp-query+protectedtitles-description','s:40:\"List all titles protected from creation.\";'),('pt','messages:apihelp-query+protectedtitles-param-namespace','s:37:\"Only list titles in these namespaces.\";'),('pt','messages:apihelp-query+protectedtitles-param-level','s:46:\"Only list titles with these protection levels.\";'),('pt','messages:apihelp-query+protectedtitles-param-start','s:43:\"Start listing at this protection timestamp.\";'),('pt','messages:apihelp-query+protectedtitles-param-end','s:42:\"Stop listing at this protection timestamp.\";'),('pt','messages:apihelp-query+protectedtitles-param-prop','s:24:\"Which properties to get:\";'),('pt','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:48:\"Adds the timestamp of when protection was added.\";'),('pt','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:40:\"Adds the user that added the protection.\";'),('pt','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:43:\"Adds the user ID that added the protection.\";'),('pt','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:36:\"Adds the comment for the protection.\";'),('pt','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:43:\"Adds the parsed comment for the protection.\";'),('pt','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:57:\"Adds the timestamp of when the protection will be lifted.\";'),('pt','messages:apihelp-query+protectedtitles-example-generator','s:53:\"Find links to protected titles in the main namespace.\";'),('pt','messages:apihelp-query+querypage-description','s:54:\"Get a list provided by a QueryPage-based special page.\";'),('pt','messages:apihelp-query+querypage-param-page','s:59:\"The name of the special page. Note, this is case sensitive.\";'),('pt','messages:apihelp-query+querypage-param-limit','s:28:\"Number of results to return.\";'),('pt','messages:apihelp-query+querypage-example-ancientpages','s:45:\"Return results from [[Special:Ancientpages]].\";'),('pt','messages:apihelp-query+random-description','s:326:\"Get a set of random pages.\n\nPages are listed in a fixed sequence, only the starting point is random. This means that if, for example, <samp>Main Page</samp> is the first random page in the list, <samp>List of fictional monkeys</samp> will <em>always</em> be second, <samp>List of people on stamps of Vanuatu</samp> third, etc.\";'),('pt','messages:apihelp-query+random-param-namespace','s:38:\"Return pages in these namespaces only.\";'),('pt','messages:apihelp-query+random-param-limit','s:45:\"Limit how many random pages will be returned.\";'),('pt','messages:apihelp-query+random-param-redirect','s:47:\"Use <kbd>$1filterredir=redirects</kbd> instead.\";'),('pt','messages:apihelp-query+random-example-simple','s:48:\"Return two random pages from the main namespace.\";'),('pt','messages:apihelp-query+random-example-generator','s:64:\"Return page info about two random pages from the main namespace.\";'),('pt','messages:apihelp-query+recentchanges-description','s:25:\"Enumerate recent changes.\";'),('pt','messages:apihelp-query+recentchanges-param-start','s:40:\"The timestamp to start enumerating from.\";'),('pt','messages:apihelp-query+recentchanges-param-end','s:33:\"The timestamp to end enumerating.\";'),('pt','messages:apihelp-query+recentchanges-param-namespace','s:40:\"Filter changes to only these namespaces.\";'),('pt','messages:apihelp-query+recentchanges-param-prop','s:41:\"Include additional pieces of information:\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:66:\"Adds the user responsible for the edit and tags if they are an IP.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:42:\"Adds the user ID responsible for the edit.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:30:\"Adds the comment for the edit.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:37:\"Adds the parsed comment for the edit.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:27:\"Adds timestamp of the edit.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:32:\"Adds the page title of the edit.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:68:\"Adds the page ID, recent changes ID and the new and old revision ID.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:42:\"Adds the new and old page length in bytes.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:32:\"Tags edit if page is a redirect.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:57:\"Tags patrollable edits as being patrolled or unpatrolled.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:60:\"Adds log information (log ID, log type, etc) to log entries.\";'),('pt','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:65:\"Adds the content checksum for entries associated with a revision.\";'),('pt','messages:apihelp-query+recentchanges-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('pt','messages:apihelp-query+recentchanges-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('pt','messages:apihelp-query+recentchanges-param-limit','s:33:\"How many total changes to return.\";'),('pt','messages:apihelp-query+recentchanges-param-type','s:31:\"Which types of changes to show.\";'),('pt','messages:apihelp-query+recentchanges-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('pt','messages:apihelp-query+recentchanges-param-generaterevisions','s:174:\"When being used as a generator, generate revision IDs rather than titles. Recent change entries without associated revision IDs (e.g. most log entries) will generate nothing.\";'),('pt','messages:apihelp-query+recentchanges-example-generator','s:47:\"Get page info about recent unpatrolled changes.\";'),('pt','messages:apihelp-query+redirects-description','s:41:\"Returns all redirects to the given pages.\";'),('pt','messages:apihelp-query+redirects-param-prop','s:24:\"Which properties to get:\";'),('pt','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:25:\"Page ID of each redirect.\";'),('pt','messages:apihelp-query+redirects-param-limit','s:29:\"How many redirects to return.\";'),('pt','messages:apihelp-query+redirects-param-show','s:139:\"Show only items that meet these criteria:\n;fragment:Only show redirects with a fragment.\n;!fragment:Only show redirects without a fragment.\";'),('pt','messages:apihelp-query+redirects-example-simple','s:45:\"Get a list of redirects to the [[Main Page]].\";'),('pt','messages:apihelp-query+redirects-example-generator','s:57:\"Get information about all redirects to the [[Main Page]].\";'),('pt','messages:apihelp-query+revisions-description','s:294:\"Get revision information.\n\nMay be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";'),('pt','messages:apihelp-query+revisions-paraminfo-singlepageonly','s:46:\"May only be used with a single page (mode #2).\";'),('pt','messages:apihelp-query+revisions-param-startid','s:44:\"From which revision ID to start enumeration.\";'),('pt','messages:apihelp-query+revisions-param-endid','s:46:\"Stop revision enumeration on this revision ID.\";'),('pt','messages:apihelp-query+revisions-param-start','s:51:\"From which revision timestamp to start enumeration.\";'),('pt','messages:apihelp-query+revisions-param-end','s:31:\"Enumerate up to this timestamp.\";'),('pt','messages:apihelp-query+revisions-param-user','s:36:\"Only include revisions made by user.\";'),('pt','messages:apihelp-query+revisions-param-excludeuser','s:31:\"Exclude revisions made by user.\";'),('pt','messages:apihelp-query+revisions-param-tag','s:41:\"Only list revisions tagged with