8:\"Send a password reset email to a user.\";'),('pt','messages:apihelp-resetpassword-description-noroutes','s:148:\"No password reset routes are available.\n\nEnable routes in <var>[[mw:Manual:$wgPasswordResetRoutes|$wgPasswordResetRoutes]]</var> to use this module.\";'),('pt','messages:apihelp-resetpassword-param-user','s:17:\"User being reset.\";'),('pt','messages:apihelp-resetpassword-param-email','s:38:\"Email address of the user being reset.\";'),('pt','messages:apihelp-resetpassword-param-capture','s:98:\"Return the temporary passwords that were sent. Requires the <code>passwordreset</code> user right.\";'),('pt','messages:apihelp-resetpassword-example-user','s:55:\"Send a password reset email to user <kbd>Example</kbd>.\";'),('pt','messages:apihelp-resetpassword-example-email','s:89:\"Send a password reset email for all users with email address <kbd>user@example.com</kbd>.\";'),('pt','messages:apihelp-revisiondelete-description','s:30:\"Delete and undelete revisions.\";'),('pt','messages:apihelp-revisiondelete-param-type','s:42:\"Type of revision deletion being performed.\";'),('pt','messages:apihelp-revisiondelete-param-target','s:63:\"Page title for the revision deletion, if required for the type.\";'),('pt','messages:apihelp-revisiondelete-param-ids','s:44:\"Identifiers for the revisions to be deleted.\";'),('pt','messages:apihelp-revisiondelete-param-hide','s:31:\"What to hide for each revision.\";'),('pt','messages:apihelp-revisiondelete-param-show','s:33:\"What to unhide for each revision.\";'),('pt','messages:apihelp-revisiondelete-param-suppress','s:63:\"Whether to suppress data from administrators as well as others.\";'),('pt','messages:apihelp-revisiondelete-param-reason','s:38:\"Reason for the deletion or undeletion.\";'),('pt','messages:apihelp-revisiondelete-example-revision','s:76:\"Hide content for revision <kbd>12345</kbd> on the page <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-revisiondelete-example-log','s:85:\"Hide all data on log entry <kbd>67890</kbd> with the reason <kbd>BLP violation</kbd>.\";'),('pt','messages:apihelp-rollback-description','s:129:\"Undo the last edit to the page.\n\nIf the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('pt','messages:apihelp-rollback-param-tags','s:30:\"Tags to apply to the rollback.\";'),('pt','messages:apihelp-rollback-param-user','s:51:\"Name of the user whose edits are to be rolled back.\";'),('pt','messages:apihelp-rollback-param-summary','s:60:\"Custom edit summary. If empty, default summary will be used.\";'),('pt','messages:apihelp-rollback-param-markbot','s:52:\"Mark the reverted edits and the revert as bot edits.\";'),('pt','messages:apihelp-rollback-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('pt','messages:apihelp-rollback-example-simple','s:81:\"Roll back the last edits to page <kbd>Main Page</kbd> by user <kbd>Example</kbd>.\";'),('pt','messages:apihelp-rollback-example-summary','s:180:\"Roll back the last edits to page <kbd>Main Page</kbd> by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('pt','messages:apihelp-rsd-description','s:47:\"Export an RSD (Really Simple Discovery) schema.\";'),('pt','messages:apihelp-rsd-example-simple','s:22:\"Export the RSD schema.\";'),('pt','messages:apihelp-setnotificationtimestamp-description','s:222:\"Update the notification timestamp for watched pages.\n\nThis affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('pt','messages:apihelp-setnotificationtimestamp-param-timestamp','s:53:\"Timestamp to which to set the notification timestamp.\";'),('pt','messages:apihelp-setnotificationtimestamp-param-torevid','s:62:\"Revision to set the notification timestamp to (one page only).\";'),('pt','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:70:\"Revision to set the notification timestamp newer than (one page only).\";'),('pt','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('pt','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('pt','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('pt','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('pt','messages:apihelp-stashedit-description','s:134:\"Prepare an edit in shared cache.\n\nThis is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('pt','messages:apihelp-stashedit-param-title','s:31:\"Title of the page being edited.\";'),('pt','messages:apihelp-stashedit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('pt','messages:apihelp-stashedit-param-stashedtexthash','s:52:\"Page content hash from a prior stash to use instead.\";'),('pt','messages:apihelp-stashedit-param-baserevid','s:33:\"Revision ID of the base revision.\";'),('pt','messages:apihelp-tag-description','s:67:\"Add or remove change tags from individual revisions or log entries.\";'),('pt','messages:apihelp-tag-param-rcid','s:67:\"One or more recent changes IDs from which to add or remove the tag.\";'),('pt','messages:apihelp-tag-param-revid','s:61:\"One or more revision IDs from which to add or remove the tag.\";'),('pt','messages:apihelp-tag-param-logid','s:62:\"One or more log entry IDs from which to add or remove the tag.\";'),('pt','messages:apihelp-tag-param-add','s:53:\"Tags to add. Only manually defined tags can be added.\";'),('pt','messages:apihelp-tag-param-remove','s:98:\"Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('pt','messages:apihelp-tag-example-rev','s:79:\"Add the <kbd>vandalism</kbd> tag to revision ID 123 without specifying a reason\";'),('pt','messages:apihelp-tag-example-log','s:95:\"Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('pt','messages:apihelp-tokens-description','s:136:\"Get tokens for data-modifying actions.\n\nThis module is deprecated in favor of [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('pt','messages:apihelp-tokens-param-type','s:26:\"Types of token to request.\";'),('pt','messages:apihelp-tokens-example-edit','s:37:\"Retrieve an edit token (the default).\";'),('pt','messages:apihelp-tokens-example-emailmove','s:41:\"Retrieve an email token and a move token.\";'),('pt','messages:apihelp-unblock-param-tags','s:51:\"Change tags to apply to the entry in the block log.\";'),('pt','messages:apihelp-unblock-example-user','s:61:\"Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('pt','messages:apihelp-undelete-description','s:281:\"Restore revisions of a deleted page.\n\nA list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevs|list=deletedrevs]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('pt','messages:apihelp-undelete-param-tags','s:54:\"Change tags to apply to the entry in the deletion log.\";'),('pt','messages:apihelp-undelete-param-timestamps','s:129:\"Timestamps of the revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('pt','messages:apihelp-undelete-param-fileids','s:127:\"IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('pt','messages:apihelp-undelete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('pt','messages:apihelp-undelete-example-revisions','s:52:\"Undelete two revisions of page <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-unlinkaccount-description','s:58:\"Remove a linked third-party account from the current user.\";'),('pt','messages:apihelp-unlinkaccount-example-simple','s:111:\"Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('pt','messages:apihelp-upload-description','s:601:\"Upload a file, or get the status of pending uploads.\n\nSeveral methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('pt','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('pt','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('pt','messages:apihelp-upload-param-tags','s:68:\"Change tags to apply to the upload log entry and file page revision.\";'),('pt','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('pt','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('pt','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('pt','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('pt','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('pt','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('pt','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('pt','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('pt','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('pt','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('pt','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('pt','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('pt','messages:apihelp-upload-example-url','s:18:\"Upload from a URL.\";'),('pt','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('pt','messages:apihelp-userrights-description','s:33:\"Change a user\'s group membership.\";'),('pt','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('pt','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('pt','messages:apihelp-watch-description','s:54:\"Add or remove pages from the current user\'s watchlist.\";'),('pt','messages:apihelp-watch-param-title','s:55:\"The page to (un)watch. Use <var>$1titles</var> instead.\";'),('pt','messages:apihelp-watch-param-unwatch','s:54:\"If set the page will be unwatched rather than watched.\";'),('pt','messages:apihelp-watch-example-watch','s:36:\"Watch the page <kbd>Main Page</kbd>.\";'),('pt','messages:apihelp-watch-example-generator','s:48:\"Watch the first few pages in the main namespace.\";'),('pt','messages:apihelp-format-example-generic','s:41:\"Return the query result in the $1 format.\";'),('pt','messages:apihelp-format-param-wrappedhtml','s:86:\"Return the pretty-printed HTML and associated ResourceLoader modules as a JSON object.\";'),('pt','messages:apihelp-json-param-callback','s:113:\"If specified, wraps the output into a given function call. For safety, all user-specific data will be restricted.\";'),('pt','messages:apihelp-json-param-utf8','s:190:\"If specified, encodes most (but not all) non-ASCII characters as UTF-8 instead of replacing them with hexadecimal escape sequences. Default when <var>formatversion</var> is not <kbd>1</kbd>.\";'),('pt','messages:apihelp-json-param-ascii','s:126:\"If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('pt','messages:apihelp-json-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('pt','messages:apihelp-jsonfm-description','s:50:\"Output data in JSON format (pretty-print in HTML).\";'),('pt','messages:apihelp-php-description','s:37:\"Output data in serialized PHP format.\";'),('pt','messages:apihelp-php-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('pt','messages:apihelp-phpfm-description','s:60:\"Output data in serialized PHP format (pretty-print in HTML).\";'),('pt','messages:apihelp-rawfm-description','s:81:\"Output data, including debugging elements, in JSON format (pretty-print in HTML).\";'),('pt','messages:apihelp-xml-description','s:26:\"Output data in XML format.\";'),('pt','messages:apihelp-xml-param-xslt','s:144:\"If specified, adds the named page as an XSL stylesheet. The value must be a title in the {{ns:mediawiki}} namespace ending in <code>.xsl</code>.\";'),('pt','messages:apihelp-xml-param-includexmlnamespace','s:36:\"If specified, adds an XML namespace.\";'),('pt','messages:apihelp-xmlfm-description','s:49:\"Output data in XML format (pretty-print in HTML).\";'),('pt','messages:api-format-title','s:20:\"MediaWiki API result\";'),('pt','messages:api-format-prettyprint-header','s:372:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set <kbd>format=$2</kbd>.\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('pt','messages:api-format-prettyprint-header-only-html','s:200:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('pt','messages:api-pageset-param-titles','s:28:\"A list of titles to work on.\";'),('pt','messages:api-pageset-param-pageids','s:30:\"A list of page IDs to work on.\";'),('pt','messages:api-pageset-param-revids','s:34:\"A list of revision IDs to work on.\";'),('pt','messages:api-pageset-param-generator','s:166:\"Get the list of pages to work on by executing the specified query module.\n\n<strong>Note:</strong> Generator parameter names must be prefixed with a \"g\", see examples.\";'),('pt','messages:api-pageset-param-redirects-generator','s:151:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>, and in pages returned by <var>$1generator</var>.\";'),('pt','messages:api-pageset-param-redirects-nogenerator','s:102:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>.\";'),('pt','messages:api-pageset-param-converttitles','s:171:\"Convert titles to other variants if necessary. Only works if the wiki\'s content language supports variant conversion. Languages that support variant conversion include $1.\";'),('pt','messages:api-help-fallback-description','s:2:\"$1\";'),('pt','messages:api-help-fallback-parameter','s:2:\"$1\";'),('pt','messages:api-help-fallback-example','s:2:\"$1\";'),('pt','messages:api-help-flags','s:0:\"\";'),('pt','messages:api-help-flag-internal','s:94:\"<strong>This module is internal or unstable.</strong> Its operation may change without notice.\";'),('pt','messages:api-help-flag-generator','s:39:\"This module can be used as a generator.\";'),('pt','messages:api-help-source-unknown','s:52:\"Source: <span class=\"apihelp-unknown\">unknown</span>\";'),('pt','messages:api-help-help-urls','s:0:\"\";'),('pt','messages:api-help-param-type-integer','s:48:\"Type: {{PLURAL:$1|1=integer|2=list of integers}}\";'),('pt','messages:api-help-param-type-password','s:0:\"\";'),('pt','messages:api-help-param-type-timestamp','s:110:\"Type: {{PLURAL:$1|1=timestamp|2=list of timestamps}} ([[Special:ApiHelp/main#main/datatypes|allowed formats]])\";'),('pt','messages:api-help-param-list-can-be-empty','s:49:\"{{PLURAL:$1|0=Must be empty|Can be empty, or $2}}\";'),('pt','messages:api-help-param-limit','s:24:\"No more than $1 allowed.\";'),('pt','messages:api-help-param-limit2','s:38:\"No more than $1 ($2 for bots) allowed.\";'),('pt','messages:api-help-param-integer-min','s:59:\"The {{PLURAL:$1|1=value|2=values}} must be no less than $2.\";'),('pt','messages:api-help-param-integer-max','s:62:\"The {{PLURAL:$1|1=value|2=values}} must be no greater than $3.\";'),('pt','messages:api-help-param-integer-minmax','s:61:\"The {{PLURAL:$1|1=value|2=values}} must be between $2 and $3.\";'),('pt','messages:api-help-param-upload','s:58:\"Must be posted as a file upload using multipart/form-data.\";'),('pt','messages:api-help-param-token','s:85:\"A \"$1\" token retrieved from [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('pt','messages:api-help-param-token-webui','s:65:\"For compatibility, the token used in the web UI is also accepted.\";'),('pt','messages:api-help-param-disabled-in-miser-mode','s:54:\"Disabled due to [[mw:Manual:$wgMiserMode|miser mode]].\";'),('pt','messages:api-help-param-limited-in-miser-mode','s:207:\"<strong>Note:</strong> Due to [[mw:Manual:$wgMiserMode|miser mode]], using this may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('pt','messages:api-help-param-direction','s:174:\"In which direction to enumerate:\n;newer:List oldest first. Note: $1start has to be before $1end.\n;older:List newest first (default). Note: $1start has to be later than $1end.\";'),('pt','messages:api-help-param-continue','s:54:\"When more results are available, use this to continue.\";'),('pt','messages:api-help-right-apihighlimits','s:135:\"Use higher limits in API queries (slow queries: $1; fast queries: $2). The limits for slow queries also apply to multivalue parameters.\";'),('pt','messages:api-help-authmanager-general-usage','s:1251:\"The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),('pt','messages:api-help-authmanagerhelper-requests','s:243:\"Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),('pt','messages:api-help-authmanagerhelper-request','s:191:\"Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),('pt','messages:api-help-authmanagerhelper-messageformat','s:37:\"Format to use for returning messages.\";'),('pt','messages:api-help-authmanagerhelper-mergerequestfields','s:71:\"Merge field information for all authentication requests into one array.\";'),('pt','messages:api-help-authmanagerhelper-preservestate','s:65:\"Preserve state from a previous failed login attempt, if possible.\";'),('pt','messages:api-help-authmanagerhelper-returnurl','s:514:\"Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),('pt','messages:api-help-authmanagerhelper-continue','s:149:\"This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),('pt','messages:api-help-authmanagerhelper-additional-params','s:341:\"This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),('pt','messages:flaggedrevs-stable-categories','s:0:\"\";'),('pt','messages:flaggedrevs-diffonly','s:0:\"\";'),('pt','messages:group-editor.css','s:46:\"/* CSS placed here will affect editors only */\";'),('pt','messages:group-editor.js','s:45:\"/* JS placed here will affect editors only */\";'),('pt','messages:group-reviewer.css','s:48:\"/* CSS placed here will affect reviewers only */\";'),('pt','messages:group-reviewer.js','s:47:\"/* JS placed here will affect reviewers only */\";'),('pt','messages:group-autoreview.css','s:52:\"/* CSS placed here will affect autoreviewers only */\";'),('pt','messages:group-autoreview.js','s:51:\"/* JS placed here will affect autoreviewers only */\";'),('pt','messages:logentry-review-approve','s:41:\"$1 {{GENDER:$2|reviewed}} a version of $3\";'),('pt','messages:logentry-review-approve-auto','s:55:\"$1 automatically {{GENDER:$2|reviewed}} a version of $3\";'),('pt','messages:logentry-review-unapprove','s:43:\"$1 {{GENDER:$2|deprecated}} a version of $3\";'),('pt','messages:logentry-stable-move_stable','s:60:\"$1 {{GENDER:$2|moved}