is already locked.\";'),('en','messages:databasenotlocked','s:27:\"The database is not locked.\";'),('en','messages:lockedbyandtime','s:33:\"(by {{GENDER:$1|$1}} on $2 at $3)\";'),('en','messages:move-page','s:7:\"Move $1\";'),('en','messages:movepage-summary','s:0:\"\";'),('en','messages:move-page-legend','s:9:\"Move page\";'),('en','messages:movepagetext','s:901:\"Using the form below will rename a page, moving all of its history to the new name.\nThe old title will become a redirect page to the new title.\nYou can update redirects that point to the original title automatically.\nIf you choose not to, be sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will <strong>not</strong> be moved if there is already a page at the new title, unless the latter is a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n<strong>Note:</strong>\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),('en','messages:movepagetext-noredirectfixer','s:798:\"Using the form below will rename a page, moving all of its history to the new name.\nThe old title will become a redirect page to the new title.\nBe sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will <strong>not</strong> be moved if there is already a page at the new title, unless it is a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n<strong>Note:</strong>\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),('en','messages:movepagetalktext','s:216:\"If you check this box, the associated talk page will be automatically moved to new title, unless a non-empty talk page already exists there.\n\nIn this case, you will have to move or merge the page manually if desired.\";'),('en','messages:moveuserpage-warning','s:148:\"<strong>Warning:</strong> You are about to move a user page. Please note that only the page will be moved and the user will <em>not</em> be renamed.\";'),('en','messages:movecategorypage-warning','s:196:\"<strong>Warning:</strong> You are about to move a category page. Please note that only the page will be moved and any pages in the old category will <em>not</em> be recategorized into the new one.\";'),('en','messages:movenologintext','s:81:\"You must be a registered user and [[Special:UserLogin|logged in]] to move a page.\";'),('en','messages:movenotallowed','s:41:\"You do not have permission to move pages.\";'),('en','messages:movenotallowedfile','s:41:\"You do not have permission to move files.\";'),('en','messages:cant-move-user-page','s:68:\"You do not have permission to move user pages (apart from subpages).\";'),('en','messages:cant-move-to-user-page','s:84:\"You do not have permission to move a page to a user page (except to a user subpage).\";'),('en','messages:cant-move-category-page','s:50:\"You do not have permission to move category pages.\";'),('en','messages:cant-move-to-category-page','s:61:\"You do not have permission to move a page to a category page.\";'),('en','messages:newtitle','s:10:\"New title:\";'),('en','messages:move-watch','s:33:\"Watch source page and target page\";'),('en','messages:movepagebtn','s:9:\"Move page\";'),('en','messages:pagemovedsub','s:14:\"Move succeeded\";'),('en','messages:movepage-moved','s:44:\"<strong>\"$1\" has been moved to \"$2\"</strong>\";'),('en','m