,'s:16:\"Expand templates\";'),('en','messages:expand_templates_intro','s:295:\"This special page takes text and expands all templates in it recursively.\nIt also expands supported parser functions like\n<code><nowiki>{{</nowiki>#language:…}}</code> and variables like\n<code><nowiki>{{</nowiki>CURRENTDAY}}</code>.\nIn fact, it expands pretty much everything in double-braces.\";'),('en','messages:expand_templates_title','s:42:\"Context title, for {{FULLPAGENAME}}, etc.:\";'),('en','messages:expand_templates_input','s:11:\"Input text:\";'),('en','messages:expand_templates_output','s:6:\"Result\";'),('en','messages:expand_templates_xml_output','s:10:\"XML output\";'),('en','messages:expand_templates_html_output','s:15:\"Raw HTML output\";'),('en','messages:expand_templates_ok','s:2:\"OK\";'),('en','messages:expand_templates_remove_comments','s:15:\"Remove comments\";'),('en','messages:expand_templates_remove_nowiki','s:32:\"Suppress <nowiki> tags in result\";'),('en','messages:expand_templates_generate_xml','s:19:\"Show XML parse tree\";'),('en','messages:expand_templates_generate_rawhtml','s:13:\"Show raw HTML\";'),('en','messages:expand_templates_preview','s:7:\"Preview\";'),('en','messages:expand_templates_preview_fail_html','s:377:\"<em>Because {{SITENAME}} has raw HTML enabled and there was a loss of session data, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please try again.</strong>\nIf it still does not work, try [[Special:UserLogout|logging out]] and logging back in, and check that your browser allows cookies from this site.\";'),('en','messages:expand_templates_preview_fail_html_anon','s:253:\"<em>Because {{SITENAME}} has raw HTML enabled and you are not logged in, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please [[Special:UserLogin|log in]] and try again.</strong>\";'),('en','messages:expand_templates_input_missing','s:45:\"You need to provide at least some input text.\";'),('en','messages:pagelanguage','s:20:\"Change page language\";'),('en','messages:pagelang-name','s:4:\"Page\";'),('en','messages:pagelang-language','s:8:\"Language\";'),('en','messages:pagelang-use-default','s:20:\"Use default language\";'),('en','messages:pagelang-select-lang','s:15:\"Select language\";'),('en','messages:pagelang-submit','s:6:\"Submit\";'),('en','messages:right-pagelang','s:20:\"Change page language\";'),('en','messages:action-pagelang','s:24:\"change the page language\";'),('en','messages:log-name-pagelang','s:19:\"Language change log\";'),('en','messages:log-description-pagelang','s:43:\"This is a log of changes in page languages.\";'),('en','messages:logentry-pagelang-pagelang','s:57:\"$1 {{GENDER:$2|changed}} the language of $3 from $4 to $5\";'),('en','messages:default-skin-not-found','s:1658:\"Whoops! The default skin for your wiki, defined in <code dir=\"ltr\">$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYour installation seems to include the following {{PLURAL:$4|skin|skins}}. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable {{PLURAL:$4|it|them and choose the default}}.\n\n$2\n\n; If you have just installed MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Using Git to download skins].\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer.\n\n; If you have just upgraded MediaWiki:\n: MediaWiki 1.24 and newer no longer automatically enables installed skins (see [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Manual: Skin autodiscovery]). You can paste the following {{PLURAL:$5|line|lines}} into <code>LocalSettings.php</code> to enable {{PLURAL:$5|the|all}} installed {{PLURAL:$5|skin|skins}}:\n\n<pre dir=\"ltr\">$3</pre>\n\n; If you have just modified <code>LocalSettings.php</code>:\n: Double-check the skin names for typos.\";'),('en','messages:default-skin-not-found-no-skins','s:1178:\"Whoops! The default skin for your wiki, defined in <code>$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYou have no installed skins.\n\n; If you have just installed or upgraded MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. MediaWiki 1.24 and newer doesn\'t include any skins in the main repository. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Using Git to download skins].\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable skins and choose the default.\n\";'),('en','messages:default-skin-not-found-row-enabled','s:32:\"* <code>$1</code> / $2 (enabled)\";'),('en','messages:default-skin-not-found-row-disabled','s