','messages:apihelp-query+iwlinks-example-simple','s:55:\"Get interwiki links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+langbacklinks-description','s:284:\"Find all pages that link to the given language link.\n\nCan be used to find all links with a language code, or all links to a title (with a given language). Using neither parameter is effectively \"all language links\".\n\nNote that this may not consider language links added by extensions.\";'),('en','messages:apihelp-query+langbacklinks-param-lang','s:31:\"Language for the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-title','s:54:\"Language link to search for. Must be used with $1lang.\";'),('en','messages:apihelp-query+langbacklinks-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+langbacklinks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lllang','s:44:\"Adds the language code of the language link.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lltitle','s:36:\"Adds the title of the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langbacklinks-example-simple','s:34:\"Get pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-example-generator','s:52:\"Get information about pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langlinks-description','s:53:\"Returns all interlanguage links from the given pages.\";'),('en','messages:apihelp-query+langlinks-param-limit','s:29:\"How many langlinks to return.\";'),('en','messages:apihelp-query+langlinks-param-url','s:68:\"Whether to get the full URL (cannot be used with <var>$1prop</var>).\";'),('en','messages:apihelp-query+langlinks-param-prop','s:63:\"Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-url','s:18:\"Adds the full URL.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-langname','s:104:\"Adds the localised language name (best effort). Use <var>$1inlanguagecode</var> to control the language.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-autonym','s:30:\"Adds the native language name.\";'),('en','messages:apihelp-query+langlinks-param-lang','s:51:\"Only return language links with this language code.\";'),('en','messages:apihelp-query+langlinks-param-title','s:56:\"Link to search for. Must be used with <var>$1lang</var>.\";'),('en','messages:apihelp-query+langlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langlinks-param-inlanguagecode','s:43:\"Language code for localised language names.\";'),('en','messages:apihelp-query+langlinks-example-simple','s:59:\"Get interlanguage links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+links-description','s:39:\"Returns all links from the given pages.\";'),('en','messages:apihelp-query+links-param-namespace','s:36:\"Show links in these namespaces only.\";'),('en','messages:apihelp-query+links-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+links-param-titles','s:101:\"Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('en','messages:apihelp-query+links-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+links-example-simple','s:44:\"Get links from the page <kbd>Main Page</kbd>\";'),('en','messages:apihelp-query+links-example-generator','s:70:\"Get information about the link pages in the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+links-example-namespaces','s:95:\"Get links from the page <kbd>Main Page</kbd> in the {{ns:user}} and {{ns:template}} namespaces.\";'),('en','messages:apihelp-query+linkshere-description','s:44:\"Find all pages that link to the given pages.\";'),('en','messages:apihelp-query+linkshere-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-pageid','s:21:\"Page ID of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-title','s:19:\"Title of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-redirect','s:31:\"Flag if the page is a redirect.\";'),('en','messages:apihelp-query+linkshere-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+linkshere-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+linkshere-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+linkshere-example-simple','s:49:\"Get a list of pages linking to the [[Main Page]].\";'),('en','messages:apihelp-query+linkshere-example-generator','s:57:\"Get information about pages linking to the [[Main Page]].\";'),('en','messages:apihelp-query+logevents-description','s:21:\"Get events from logs.\";'),('en','messages:apihelp-query+logevents-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-ids','s:29:\"Adds the ID of the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-title','s:45:\"Adds the title of the page for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-type','s:27:\"Adds the type of log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-user','s:44:\"Adds the user responsible for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-userid','s:55:\"Adds the user ID who was responsible for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-timestamp','s:37:\"Adds the timestamp for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-comment','s:34:\"Adds the comment of the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-parsedcomment','s:41:\"Adds the parsed comment of the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-details','s:45:\"Lists additional details about the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-tags','s:29:\"Lists tags for the log event.\";'),('en','messages:apihelp-query+logevents-param-type','s:37:\"Filter log entries to only this type.\";'),('en','messages:apihelp-query+logevents-param-action','s:210:\"Filter log actions to only this action. Overrides <var>$1type</var>. In the list of possible values, values with the asterisk wildcard such as <kbd>action/*</kbd> can have different strings after the slash (/).\";'),('en','messages:apihelp-query+logevents-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+logevents-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+logevents-param-user','s:47:\"Filter entries to those made by the given user.\";'),('en','messages:apihelp-query+logevents-param-title','s:42:\"Filter entries to those related to a page.\";'),('en','messages:apihelp-query+logevents-param-namespace','s:47:\"Filter entries to those in the given namespace.\";'),('en','messages:apihelp-query+logevents-param-prefix','s:43:\"Filter entries that start with this prefix.\";'),('en','messages:apihelp-query+logevents-param-tag','s:45:\"Only list event entries tagged with this tag.\";'),('en','messages:apihelp-query+logevents-param-limit','s:39:\"How many total event entries to return.\";'),('en','messages:apihelp-query+logevents-example-simple','s:23:\"List recent log events.\";'),('en','messages:apihelp-query+pagepropnames-description','s:48:\"List all page property names in use on the wiki.\";'),('en','messages:apihelp-query+pagepropnames-param-limit','s:38:\"The maximum number of names to return.\";'),('en','messages:apihelp-query+pagepropnames-example-simple','s:28:\"Get first 10 property names.\";'),('en','messages:apihelp-query+pageprops-description','s:56:\"Get various page properties defined in the page content.\";'),('en','messages:apihelp-query+pageprops-param-prop','s:215:\"Only list these page properties (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use). Useful for checking whether pages use a certain page property.\";'),('en','messages:apihelp-query+pageprops-example-simple','s:75:\"Get properties for the pages <kbd>Main Page</kbd> and <kbd>MediaWiki</kbd>.\";'),('en','messages:apihelp-query+pageswithprop-description','s:43:\"List all pages using a given page property.\";'),('en','messages:apihelp-query+pageswithprop-param-propname','s:163:\"Page property for which to enumerate pages (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use).\";'),('en','messages:apihelp-query+pageswithprop-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:36:\"Adds the value of the page property.\";'),('en','messages:apihelp-query+pageswithprop-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+pageswithprop-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+pageswithprop-example-simple','s:81:\"List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('en','messages:apihelp-query+pageswithprop-example-generator','s:89:\"Get additional information about the first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('en','messages:apihelp-query+prefixsearch-description','s:550:\"Perform a prefix search for page titles.\n\nDespite the similarity in names, this module is not intended to be equivalent to [[Special:PrefixIndex]]; for that, see <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> with the <kbd>apprefix</kbd> parameter. The purpose of this module is similar to <kbd>[[Special:ApiHelp/opensearch|action=opensearch]]</kbd>: to take user input and provide the best-matching titles. Depending on the search engine backend, this might include typo correction, redirect avoidance, or other heuristics.\";'),('en','messages:apihelp-query+prefixsearch-param-search','s:14:\"Search string.\";'),('en','messages:apihelp-query+prefixsearch-param-namespace','s:21:\"Namespaces to search.\";'),('en','messages:apihelp-query+prefixsearch-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-query+prefixsearch-param-offset','s:26:\"Number of results to skip.\";'),('en','messages:apihelp-query+prefixsearch-example-simple','s:57:\"Search for page titles beginning with <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+prefixsearch-param-profile','s:22:\"Search profile to use.\";'),('en','messages:apihelp-query+protectedtitles-description','s:40:\"List all titles protected from creation.\";'),('en','messages:apihelp-query+protectedtitles-param-namespace','s:37:\"Only list titles in these namespaces.\";'),('en','messages:apihelp-query+protectedtitles-param-level','s:46:\"Only list titles with these protection levels.\";'),('en','messages:apihelp-query+protectedtitles-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+protectedtitles-param-start','s:43:\"Start listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-param-end','s:42:\"Stop listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:48:\"Adds the timestamp of when protection was added.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:40:\"Adds the user that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:43:\"Adds the user ID that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:36:\"Adds the comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:43:\"Adds the parsed comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:57:\"Adds the timestamp of when the protection will be lifted.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-level','s:26:\"Adds the protection level.\";'),('en','messages:apihelp-query+protectedtitles-example-simple','s:22:\"List protected titles.\";'),('en','messages:apihelp-query+protectedtitles-example-generator','s:53:\"Find links to protected titles in the main namespace.\";'),('en','messages:apihelp-query+querypage-description','s:54:\"Get a list provided by a QueryPage-based special page.\";'),('en','messages:apihelp-query+querypage-param-page','s:59:\"The name of the special page. Note, this is case sensitive.\";'),('en','messages:apihelp-query+querypage-param-limit','s:28:\"Number of results to return.\";'),('en','messages:apihelp-query+querypage-example-ancientpages','s:45:\"Return results from [[Special:Ancientpages]].\";'),('en','messages:apihelp-query+random-description','s:326:\"Get a set of random pages.\n\nPages are listed in a fixed sequence, only the starting point is random. This means that if, for example, <samp>Main Page</samp> is the first random page in the list, <samp>List of fictional monkeys</samp> will <em>always</em> be second, <samp>List of people on stamps of Vanuatu</samp> third, etc.\";'),('en','messages:apihelp-query+random-param-namespace','s:38:\"Return pages in these namespaces only.\";'),('en','messages:apihelp-query+random-param-limit','s:45:\"Limit how many random pages will be returned.\";'),('en','messages:apihelp-query+random-param-redirect','s:47:\"Use <kbd>$1filterredir=redirects</kbd> instead.\";'),('en','messages:apihelp-query+random-param-filterredir','s:28:\"How to filter for redirects.\";'),('en','messages:apihelp-query+random-example-simple','s:48:\"Return two random pages from the main namespace.\";'),('en','messages:apihelp-query+random-example-generator','s:64:\"Return page info about two random pages from the main namespace.\";'),('en','messages:apihelp-query+recentchanges-description','s:25:\"Enumerate recent changes.\";'),('en','messages:apihelp-query+recentchanges-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+recentchanges-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+recentchanges-param-namespace','s:40:\"Filter changes to only these namespaces.\";'),('en','messages:apihelp-query+recentchanges-param-user','s:31:\"Only list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-param-excludeuser','s:32:\"Don\'t list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-param-tag','s:39:\"Only list changes tagged with this tag.\";'),('en','messages:apihelp-query+recentchanges-param-prop','s:41:\"Include additional pieces of information:\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:66:\"Adds the user responsible for the edit and tags if they are an IP.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:42:\"Adds the user ID responsible for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:30:\"Adds the comment for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:37:\"Adds the parsed comment for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:24:\"Adds flags for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:27:\"Adds timestamp of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:32:\"Adds the page title of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:68:\"Adds the page ID, recent changes ID and the new and old revision ID.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:42:\"Adds the new and old page length in bytes.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:32:\"Tags edit if page is a redirect.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:57:\"Tags patrollable edits as being patrolled or unpatrolled.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:60:\"Adds log information (log ID, log type, etc) to log entries.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:25:\"Lists tags for the entry.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:65:\"Adds the content checksum for entries associated with a revision.\";'),('en','messages:apihelp-query+recentchanges-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('en','messages:apihelp-query+recentchanges-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+recentchanges-param-limit','s:33:\"How many total changes to return.\";'),('en','messages:apihelp-query+recentchanges-param-type','s:31:\"Which types of changes to show.\";'),('en','messages:apihelp-query+recentchanges-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+recentchanges-param-generaterevisions','s:174:\"When being used as a generator, generate revision IDs rather than titles. Recent change entries without associated revision IDs (e.g. most log entries) will generate nothing.\";'),('en','messages:apihelp-query+recentchanges-example-simple','s:20:\"List recent changes.\";'),('en','messages:apihelp-query+recentchanges-example-generator','s:47:\"Get page info about recent unpatrolled changes.\";'),('en','messages:apihelp-query+redirects-description','s:41:\"Returns all redirects to the given pages.\";'),('en','messages:apihelp-query+redirects-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:25:\"Page ID of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-title','s:23:\"Title of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:34:\"Fragment of each redirect, if any.\";'),('en','messages:apihelp-query+redirects-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+redirects-param-limit','s:29:\"How many redirects to return.\";'),('en','messages:apihelp-query+redirects-param-show','s:139:\"Show only items that meet these criteria:\n;fragment:Only show redirects with a fragment.\n;!fragment:Only show redirects without a fragment.\";'),('en','messages:apihelp-query+redirects-example-simple','s:45:\"Get a list of redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-example-generator','s:57:\"Get information about all redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+revisions-description','s:294:\"Get revision information.\n\nMay be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";'),('en','messages:apihelp-query+revisions-paraminfo-singlepageonly','s:46:\"May only be used with a single page (mode #2).\";'),('en','messages:apihelp-query+revisions-param-startid','s:44:\"From which revision ID to start enumeration.\";'),('en','messages:apihelp-query+revisions-param-endid','s:46:\"Stop revision enumeration on this revision ID.\";'),('en','messages:apihelp-query+revisions-param-start','s:51:\"From which revision timestamp to start enumeration.\";'),('en','messages:apihelp-query+revisions-param-end','s:31:\"Enumerate up to this timestamp.\";'),('en','messages:apihelp-query+revisions-param-user','s:36:\"Only include revisions made by user.\";'),('en','messages:apihelp-query+revisions-param-excludeuser','s:31:\"Exclude revisions made by user.\";'),('en','messages:apihelp-query+revisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+revisions-param-token','s:41:\"Which tokens to obtain for each revision.\";'),('en','messages:apihelp-query+revisions-example-content','s:94:\"Get data with content for the last revision of titles <kbd>API</kbd> and <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-last5','s:49:\"Get last 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5','s:50:\"Get first 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-after','s:72:\"Get first 5 revisions of the <kbd>Main Page</kbd> made after 2006-05-01.\";'),('en','messages:apihelp-query+revisions-example-first5-not-localhost','s:108:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were not made by anonymous user <kbd>127.0.0.1</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-user','s:106:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were made by the user <kbd>MediaWiki default</kbd>.\";'),('en','messages:apihelp-query+revisions+base-param-prop','s:42:\"Which properties to get for each revision:\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-ids','s:23:\"The ID of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-flags','s:23:\"Revision flags (minor).\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:30:\"The timestamp of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-user','s:28:\"User that made the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-userid','s:32:\"User ID of the revision creator.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-size','s:31:\"Length (bytes) of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-sha1','s:32:\"SHA-1 (base 16) of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:33:\"Content model ID of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:37:\"Comment by the user for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:44:\"Parsed comment by the user for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-content','s:21:\"Text of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:22:\"Tags for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:80:\"The XML parse tree of revision content (requires content model <code>$1</code>).\";'),('en','messages:apihelp-query+revisions+base-param-limit','s:42:\"Limit how many revisions will be returned.\";'),('en','messages:apihelp-query+revisions+base-param-expandtemplates','s:63:\"Expand templates in revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-generatexml','s:112:\"Generate XML parse tree for revision content (requires $1prop=content; replaced by <kbd>$1prop=parsetree</kbd>).\";'),('en','messages:apihelp-query+revisions+base-param-parse','s:124:\"Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('en','messages:apihelp-query+revisions+base-param-section','s:49:\"Only retrieve the content of this section number.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:151:\"Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:187:\"Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed against this text.\";'),('en','messages:apihelp-query+revisions+base-param-difftotextpst','s:110:\"Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:89:\"Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+search-description','s:27:\"Perform a full text search.\";'),('en','messages:apihelp-query+search-param-search','s:175:\"Search for page titles or content matching this value. You can use the search string to invoke special search features, depending on what the wiki\'s search backend implements.\";'),('en','messages:apihelp-query+search-param-namespace','s:36:\"Search only within these namespaces.\";'),('en','messages:apihelp-query+search-param-what','s:32:\"Which type of search to perform.\";'),('en','messages:apihelp-query+search-param-info','s:25:\"Which metadata to return.\";'),('en','messages:apihelp-query+search-param-prop','s:27:\"Which properties to return:\";'),('en','messages:apihelp-query+search-param-qiprofile','s:61:\"Query independent profile to use (affects ranking algorithm).\";'),('en','messages:apihelp-query+search-paramvalue-prop-size','s:35:\"Adds the size of the page in bytes.\"