),('en','messages:apihelp-query+watchlist-paramvalue-type-categorize','s:28:\"Category membership changes.\";'),('en','messages:apihelp-query+watchlist-param-owner','s:63:\"Used along with $1token to access a different user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-param-token','s:148:\"A security token (available in the user\'s [[Special:Preferences#mw-prefsection-watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-simple','s:81:\"List the top revision for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-props','s:111:\"Fetch additional information about the top revision for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-allrev','s:84:\"Fetch information about all recent changes to pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-generator','s:75:\"Fetch page info for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-generator-rev','s:80:\"Fetch revision info for recent changes to pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-wlowner','s:93:\"List the top revision for recently changed pages on the watchlist of user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+watchlistraw-description','s:46:\"Get all pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-namespace','s:40:\"Only list pages in the given namespaces.\";'),('en','messages:apihelp-query+watchlistraw-param-limit','s:45:\"How many total results to return per request.\";'),('en','messages:apihelp-query+watchlistraw-param-prop','s:35:\"Which additional properties to get:\";'),('en','messages:apihelp-query+watchlistraw-paramvalue-prop-changed','s:65:\"Adds timestamp of when the user was last notified abo