res the <code>passwordreset</code> user right.\";'),('en','messages:apihelp-resetpassword-example-user','s:55:\"Send a password reset email to user <kbd>Example</kbd>.\";'),('en','messages:apihelp-resetpassword-example-email','s:89:\"Send a password reset email for all users with email address <kbd>user@example.com</kbd>.\";'),('en','messages:apihelp-revisiondelete-description','s:30:\"Delete and undelete revisions.\";'),('en','messages:apihelp-revisiondelete-param-type','s:42:\"Type of revision deletion being performed.\";'),('en','messages:apihelp-revisiondelete-param-target','s:63:\"Page title for the revision deletion, if required for the type.\";'),('en','messages:apihelp-revisiondelete-param-ids','s:44:\"Identifiers for the revisions to be deleted.\";'),('en','messages:apihelp-revisiondelete-param-hide','s:31:\"What to hide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-show','s:33:\"What to unhide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-suppress','s:63:\"Whether to suppress data from administrators as well as others.\";'),('en','messages:apihelp-revisiondelete-param-reason','s:38:\"Reason for the deletion or undeletion.\";'),('en','messages:apihelp-revisiondelete-example-revision','s:76:\"Hide content for revision <kbd>12345</kbd> on the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-revisiondelete-example-log','s:85:\"Hide all data on log entry <kbd>67890</kbd> with the reason <kbd>BLP violation</kbd>.\";'),('en','messages:apihelp-rollback-description','s:129:\"Undo the last edit to the page.\n\nIf the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('en','messages:apihelp-rollback-param-title','s:81:\"Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-rollback-param-pageid','s:82:\"Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-rollback-param-tags','s:30:\"Tags to apply to the rollback.\";'),('en','messages:apihelp-rollback-param-user','s:51:\"Name of the user whose edits are to be rolled back.\";'),('en','messages:apihelp-rollback-param-summary','s:60:\"Custom edit summary. If empty, default summary will be used.\";'),('en','messages:apihelp-rollback-param-markbot','s:52:\"Mark the reverted edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-rollback-example-simple','s:81:\"Roll back the last edits to page <kbd>Main Page</kbd> by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-rollback-example-summary','s:180:\"Roll back the last edits to page <kbd>Main Page</kbd> by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('en','messages:apihelp-rsd-description','s:47:\"Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-rsd-example-simple','s:22:\"Export the RSD schema.\";'),('en','messages:apihelp-setnotificationtimestamp-description','s:222:\"Update the notification timestamp for watched pages.\n\nThis affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('en','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:26:\"Work on all watched pages.\";'),('en','messages:apihelp-setnotificationtimestamp-param-timestamp','s:53:\"Timestamp to which to set the notification timestamp.\";'),('en','messages:apihelp-setnotificationtimestamp-param-torevid','s:62:\"Revision to set the notification timestamp to (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:70:\"Revision to set the notification timestamp newer than (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-stashedit-description','s:134:\"Prepare an edit in shared cache.\n\nThis is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('en','messages:apihelp-stashedit-param-title','s:31:\"Title of the page being edited.\";'),('en','messages:apihelp-stashedit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-stashedit-param-sectiontitle','s:28:\"The title for a new section.\";'),('en','messages:apihelp-stashedit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-stashedit-param-stashedtexthash','s:52:\"Page content hash from a prior stash to use instead.\";'),('en','messages:apihelp-stashedit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-stashedit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-stashedit-param-baserevid','s:33:\"Revision ID of the base revision.\";'),('en','messages:apihelp-stashedit-param-summary','s:15:\"Change summary.\";'),('en','messages:apihelp-tag-description','s:67:\"Add or remove change tags from individual revisions or log entries.\";'),('en','messages:apihelp-tag-param-rcid','s:67:\"One or more recent changes IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-revid','s:61:\"One or more revision IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-logid','s:62:\"One or more log entry IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-add','s:53:\"Tags to add. Only manually defined tags can be added.\";'),('en','messages:apihelp-tag-param-remove','s:98:\"Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('en','messages:apihelp-tag-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-tag-example-rev','s:79:\"Add the <kbd>vandalism</kbd> tag to revision ID 123 without specifying a reason\";'),('en','messages:apihelp-tag-example-log','s:95:\"Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('en','messages:apihelp-tokens-description','s:136:\"Get tokens for data-modifying actions.\n\nThis module is deprecated in favor of [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('en','messages:apihelp-tokens-param-type','s:26:\"Types of token to request.\";'),('en','messages:apihelp-tokens-example-edit','s:37:\"Retrieve an edit token (the default).\";'),('en','messages:apihelp-tokens-example-emailmove','s:41:\"Retrieve an email token and a move token.\";'),('en','messages:apihelp-unblock-description','s:15:\"Unblock a user.\";'),('en','messages:apihelp-unblock-param-id','s:117:\"ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var>.\";'),('en','messages:apihelp-unblock-param-user','s:98:\"Username, IP address or IP address range to unblock. Cannot be used together with <var>$1id</var>.\";'),('en','messages:apihelp-unblock-param-reason','s:19:\"Reason for unblock.\";'),('en','messages:apihelp-unblock-param-tags','s:51:\"Change tags to apply to the entry in the block log.\";'),('en','messages:apihelp-unblock-example-id','s:33:\"Unblock block ID #<kbd>105</kbd>.\";'),('en','messages:apihelp-unblock-example-user','s:61:\"Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('en','messages:apihelp-undelete-description','s:281:\"Restore revisions of a deleted page.\n\nA list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevs|list=deletedrevs]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('en','messages:apihelp-undelete-param-title','s:29:\"Title of the page to restore.\";'),('en','messages:apihelp-undelete-param-reason','s:21:\"Reason for restoring.\";'),('en','messages:apihelp-undelete-param-tags','s:54:\"Change tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-undelete-param-timestamps','s:129:\"Timestamps of the revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-fileids','s:127:\"IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-undelete-example-page','s:35:\"Undelete page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-example-revisions','s:52:\"Undelete two revisions of page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-unlinkaccount-description','s:58:\"Remove a linked third-party account from the current user.\";'),('en','messages:apihelp-unlinkaccount-example-simple','s:111:\"Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('en','messages:apihelp-upload-description','s:601:\"Upload a file, or get the status of pending uploads.\n\nSeveral methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('en','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-tags','s:68:\"Change tags to apply to the upload log entry and file page revision.\";'),('en','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('en','messages:apihelp-upload-param-watch','s:15:\"Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('en','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('en','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-example-url','s:18:\"Upload from a URL.\";'),('en','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-userrights-description','s:33:\"Change a user\'s group membership.\";'),('en','messages:apihelp-userrights-param-user','s:10:\"User name.\";'),('en','messages:apihelp-userrights-param-userid','s:8:\"User ID.\";'),('en','messages:apihelp-userrights-param-add','s:29:\"Add the user to these groups.\";'),('en','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-watch-description','s:54:\"Add or remove pages from the current user\'s watchlist.\";'),('en','messages:apihelp-watch-param-title','s:55:\"The page to (un)watch. Use <var>$1titles</var> instead.\";'),('en','messages:apihelp-watch-param-unwatch','s:54:\"If set the page will be unwatched rather than watched.\";'),('en','messages:apihelp-watch-example-watch','s:36:\"Watch the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-watch-example-unwatch','s:38:\"Unwatch the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-watch-example-generator','s:48:\"Watch the first few pages in the main namespace.\";'),('en','messages:apihelp-format-example-generic','s:41:\"Return the query result in the $1 format.\";'),('en','messages:apihelp-format-param-wrappedhtml','s:86:\"Return the pretty-printed HTML and associated ResourceLoader modules as a JSON object.\";'),('en','messages:apihelp-json-description','s:27:\"Output data in JSON format.\";'),('en','messages:apihelp-json-param-callback','s:113:\"If specified, wraps the output into a given function call. For safety, all user-specific data will be restricted.\";'),('en','messages:apihelp-json-param-utf8','s:190:\"If specified, encodes most (but not all) non-ASCII characters as UTF-8 instead of replacing them with hexadecimal escape sequences. Default when <var>formatversion</var> is not <kbd>1</kbd>.\";'),('en','messages:apihelp-json-param-ascii','s:126:\"If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('en','messages:apihelp-json-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('en','messages:apihelp-jsonfm-description','s:50:\"Output data in JSON format (pretty-print in HTML).\";'),('en','messages:apihelp-none-description','s:15:\"Output nothing.\";'),('en','messages:apihelp-php-description','s:37:\"Output data in serialized PHP format.\";'),('en','messages:apihelp-php-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('en','messages:apihelp-phpfm-description','s:60:\"Output data in serialized PHP format (pretty-print in HTML).\";'),('en','messages:apihelp-rawfm-description','s:81:\"Output data, including debugging elements, in JSON format (pretty-print in HTML).\";'),('en','messages:apihelp-xml-description','s:26:\"Output data in XML format.\";'),('en','messages:apihelp-xml-param-xslt','s:144:\"If specified, adds the named page as an XSL stylesheet. The value must be a title in the {{ns:mediawiki}} namespace ending in <code>.xsl</code>.\";'),('en','messages:apihelp-xml-param-includexmlnamespace','s:36:\"If specified, adds an XML namespace.\";'),('en','messages:apihelp-xmlfm-description','s:49:\"Output data in XML format (pretty-print in HTML).\";'),('en','messages:api-format-title','s:20:\"MediaWiki API result\";'),('en','messages:api-format-prettyprint-header','s:372:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set <kbd>format=$2</kbd>.\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('en','messages:api-format-prettyprint-header-only-html','s:200:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('en','messages:api-pageset-param-titles','s:28:\"A list of titles to work on.\";'),('en','messages:api-pageset-param-pageids','s:30:\"A list of page IDs to work on.\";'),('en','messages:api-pageset-param-revids','s:34:\"A list of revision IDs to work on.\";'),('en','messages:api-pageset-param-generator','s:166:\"Get the list of pages to work on by executing the specified query module.\n\n<strong>Note:</strong> Generator parameter names must be prefixed with a \"g\", see examples.\";'),('en','messages:api-pageset-param-redirects-generator','s:151:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>, and in pages returned by <var>$1generator</var>.\";'),('en','messages:api-pageset-param-redirects-nogenerator','s:102:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>.\";'),('en','messages:api-pageset-param-converttitles','s:171:\"Convert titles to other variants if necessary. Only works if the wiki\'s content language supports variant conversion. Languages that support variant conversion include $1.\";'),('en','messages:api-help-title','s:18:\"MediaWiki API help\";'),('en','messages:api-help-lead','s:123:\"This is an auto-generated MediaWiki API documentation page.\n\nDocumentation and examples: https://www.mediawiki.org/wiki/API\";'),('en','messages:api-help-main-header','s:11:\"Main module\";'),('en','messages:api-help-fallback-description','s:2:\"$1\";'),('en','messages:api-help-fallback-parameter','s:2:\"$1\";'),('en','messages:api-help-fallback-example','s:2:\"$1\";'),('en','messages:api-help-flags','s:0:\"\";'),('en','messages:api-help-flag-deprecated','s:26:\"This module is deprecated.\";'),('en','messages:api-help-flag-internal','s:94:\"<strong>This module is internal or unstable.</strong> Its operation may change without notice.\";'),('en','messages:api-help-flag-readrights','s:33:\"This module requires read rights.\";'),('en','messages:api-help-flag-writerights','s:34:\"This module requires write rights.\";'),('en','messages:api-help-flag-mustbeposted','s:39:\"This module only accepts POST requests.\";'),('en','messages:api-help-flag-generator','s:39:\"This module can be used as a generator.\";'),('en','messages:api-help-source','s:10:\"Source: $1\";'),('en','messages:api-help-source-unknown','s:52:\"Source: <span class=\"apihelp-unknown\">unknown</span>\";'),('en','messages:api-help-license','s:18:\"License: [[$1|$2]]\";'),('en','messages:api-help-license-noname','s:24:\"License: [[$1|See link]]\";'),('en','messages:api-help-license-unknown','s:53:\"License: <span class=\"apihelp-unknown\">unknown</span>\";'),('en','messages:api-help-help-urls','s:0:\"\";'),('en','messages:api-help-parameters','s:35:\"{{PLURAL:$1|Parameter|Parameters}}:\";'),('en','messages:api-help-param-deprecated','s:11:\"Deprecated.\";'),('en','messages:api-help-param-required','s:27:\"This parameter is required.\";'),('en','messages:api-help-datatypes-header','s:10:\"Data types\";'),('en','messages:api-help-datatypes','s:2409:\"Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nSome parameter types in API requests need further explanation:\n;boolean\n:Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\n;timestamp\n:Timestamps may be specified in several formats. ISO 8601 date and time is recommended. All times are in UTC, any included timezone is ignored.\n:* ISO 8601 date and time, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd> (punctuation and <kbd>Z</kbd> are optional)\n:* ISO 8601 date and time with (ignored) fractional seconds, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>.<var>00001</var>Z</kbd> (dashes, colons, and <kbd>Z</kbd> are optional)\n:* MediaWiki format, <kbd><var>2001</var><var>01</var><var>15</var><var>14</var><var>56</var><var>00</var></kbd>\n:* Generic numeric format, <kbd><var>2001</var>-<var>01</var>-<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd> (optional timezone of <kbd>GMT</kbd>, <kbd>+<var>##</var></kbd>, or <kbd>-<var>##</var></kbd> is ignored)\n:* EXIF format, <kbd><var>2001</var>:<var>01</var>:<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:*RFC 2822 format (timezone may be omitted), <kbd><var>Mon</var>, <var>15</var> <var>Jan</var> <var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* RFC 850 format (timezone may be omitted), <kbd><var>Monday</var>, <var>15</var>-<var>Jan</var>-<var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* C ctime format, <kbd><var>Mon</var> <var>Jan</var> <var>15</var> <var>14</var>:<var>56</var>:<var>00</var> <var>2001</var></kbd>\n:* Seconds since 1970-01-01T00:00:00Z as a 1 to 13 digit integer (excluding <kbd>0</kbd>)\n:* The string <kbd>now</kbd>\n;alternative multiple-value separator\n:Parameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\";'),('en','messages:api-help-param-type-limit','s:31:\"Type: integer or <kbd>max</kbd>\";'),('en','messages:api-help-param-type-integer','s:48:\"Type: {{PLURAL:$1|1=integer|2=list of integers}}\";'),('en','messages:api-help-param-type-boolean','s:63:\"Type: boolean ([[Special:ApiHelp/main#main/datatypes|details]])\";'),('en','messages:api-help-param-type-password','s:0:\"\";'),('en','messages:api-help-param-type-timestamp','s:110:\"Type: {{PLURAL:$1|1=timestamp|2=list of timestamps}} ([[Special:ApiHelp/main#main/datatypes|allowed formats]])\";'),('en','messages:api-help-param-type-user','s:52:\"Type: {{PLURAL:$1|1=user name|2=list of user names}}\";'),('en','messages:api-help-param-list','s:144:\"{{PLURAL:$1|1=One of the following values|2=Values (separate with <kbd>{{!}}</kbd> or [[Special:ApiHelp/main#main/datatypes|alternative]])}}: $2\";'),('en','messages:api-help-param-list-can-be-empty','s:49:\"{{PLURAL:$1|0=Must be empty|Can be empty, or $2}}\";'),('en','messages:api-help-param-limit','s:24:\"No more than $1 allowed.\";'),('en','messages:api-help-param-limit2','s:38:\"No more than $1 ($2 for bots) allowed.\";'),('en','messages:api-help-param-integer-min','s:59:\"The {{PLURAL:$1|1=value|2=values}} must be no less than $2.\";'),('en','messages:api-help-param-integer-max','s:62:\"The {{PLURAL:$1|1=value|2=values}} must be no greater than $3.\";'),('en','messages:api-help-param-integer-minmax','s:61:\"The {{PLURAL:$1|1=value|2=values}} must be between $2 and $3.\";'),('en','messages:api-help-param-upload','s:58:\"Must be posted as a file upload using multipart/form-data.\";'),('en','messages:api-help-param-multi-separate','s:89:\"Separate values with <kbd>|</kbd> or [[Special:ApiHelp/main#main/datatypes|alternative]].\";'),('en','messages:api-help-param-multi-max','s:73:\"Maximum number of values is {{PLURAL:$1|$1}} ({{PLURAL:$2|$2}} for bots).\";'),('en','messages:api-help-param-default','s:11:\"Default: $1\";'),('en','messages:api-help-param-default-empty','s:51:\"Default: <span class=\"apihelp-empty\">(empty)</span>\";'),('en','messages:api-help-param-token','s:85:\"A \"$1\" token retrieved from [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('en','messages:api-help-param-token-webui','s:65:\"For compatibility, the token used in the web UI is also accepted.\";'),('en','messages:api-help-param-disabled-in-miser-mode','s:54:\"Disabled due to [[mw:Manual:$wgMiserMode|miser mode]].\";'),('en','messages:api-help-param-limited-in-miser-mode','s:207:\"<strong>Note:</strong> Due to [[mw:Manual:$wgMiserMode|miser mode]], using this may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('en','messages:api-help-param-direction','s:174:\"In which direction to enumerate:\n;newer:List oldest first. Note: $1start has to be before $1end.\n;older:List newest first (default). Note: $1start has to be later than $1end.\";'),('en','messages:api-help-param-continue','s:54:\"When more results are available, use this to continue.\";'),('en','messages:api-help-param-no-description','s:51:\"<span class=\"apihelp-empty\">(no description)</span>\";'),('en','messages:api-help-examples','s:31:\"{{PLURAL:$1|Example|Examples}}:\";'),('en','messages:api-help-permissions','s:37:\"{{PLURAL:$1|Permission|Permissions}}:\";'),('en','messages:api-help-permissions-granted-to','s:28:\"{{PLURAL:$1|Granted to}}: $2\";'),('en','messages:api-help-right-apihighlimits','s:135:\"Use higher limits in API queries (slow queries: $1; fast queries: $2). The limits for slow queries also apply to multivalue parameters.\";'),('en','messages:api-help-open-in-apisandbox','s:32:\"<small>[open in sandbox]</small>\";'),('en','messages:api-help-authmanager-general-usage','s:1251:\"The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),('en','messages:api-help-authmanagerhelper-requests','s:243:\"Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),('en','messages:api-help-authmanagerhelper-request','s:191:\"Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),('en','messages:api-help-authmanagerhelper-messageformat','s:37:\"Format to use for returning messages.\";'),('en','messages:api-help-authmanagerhelper-mergerequestfields','s:71:\"Merge field information for all authentication requests into one array.\";'),('en','messages:api-help-authmanagerhelper-preservestate','s:65:\"Preserve state from a previous failed login attempt, if possible.\";'),('en','messages:api-help-authmanagerhelper-returnurl','s:514:\"Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),('en','messages:api-help-authmanagerhelper-continue','s:149:\"This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),('en','messages:api-help-authmanagerhelper-additional-params','s:341:\"This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),('en','messages:api-credits-header','s:7:\"Credits\";'),('en','messages:api-credits','s:370:\"API developers:\n* Yuri Astrakhan (creator, lead developer Sep 2006–Sep 2007)\n* Roan Kattouw (lead developer Sep 2007–2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (lead developer 2013–present)\n\nPlease send your comments, suggestions and questions to mediawiki-api@lists.wikimedia.org\nor file a bug report at https://phabricator.wikimedia.org/.\";'),('en','messages:ooui-outline-control-move-down','s:14:\"Move item down\";'),('en','messages:ooui-outline-control-move-up','s:12:\"Move item up\";'),('en','messages:ooui-outline-control-remove','s:11:\"Remove item\";'),('en','messages:ooui-toolbar-more','s:4:\"More\";'),('en','messages:ooui-toolgroup-expand','s:4:\"More\";'),('en','messages:ooui-toolgroup-collapse','s:5:\"Fewer\";'),('en','messages:ooui-dialog-message-accept','s:2:\"OK\";'),('en','messages:ooui-dialog-message-reject','s:6:\"Cancel\";'),('en','messages:ooui-dialog-process-error','s:20:\"Something went wrong\";'),('en','messages:ooui-dialog-process-dismiss','s:7:\"Dismiss\";'),('en','messages:ooui-dialog-process-retry','s:9:\"Try again\";'),('en','messages:ooui-dialog-process-continue','s:8:\"Continue\";'),('en','messages:ooui-selectfile-button-select','s:13:\"Select a file\";'),('en','messages:ooui-selectfile-not-supported','s:31:\"File selection is not supported\";'),('en','messages:ooui-selectfile-placeholder','s:19:\"No file is selected\";'),('en','messages:ooui-selectfile-dragdrop-placeholder','s:14:\"Drop file here\";'),('en','messages:cologneblue.css','s:64:\"/* CSS placed here will affect users of the Cologne Blue skin */\";'),('en','messages:cologneblue.js','s:78:\"/* Any JavaScript here will be loaded for users using the Cologne Blue skin */\";'),('en','messages:skinname-cologneblue','s:12:\"Cologne Blue\";'),('en','messages:cologneblue-desc','s:42:\"A lightweight skin with minimal formatting\";'),('en','messages:modern.css','s:58:\"/* CSS placed here will affect users of the Modern skin */\";'),('en','messages:modern.js','s:72:\"/* Any JavaScript here will be loaded for users using the Modern skin */\";'),('en','messages:skinname-modern','s:6:\"Modern\";'),('en','messages:modern-desc','s:65:\"A blue/gray theme with sidebar and top bar. Derived from MonoBook\";'),('en','messages:skinname-monobook','s:8:\"MonoBook\";'),('en','messages:monobook-desc','s:109:\"The classic MediaWiki skin since 2004, named after the black-and-white photo of a book in the page background\";'),('en','messages:monobook.css','s:60:\"/* CSS placed here will affect users of the MonoBook skin */\";'),('en','messages:monobook.js','s:74:\"/* Any JavaScript here will be loaded for users using the MonoBook skin */\";'),('en','messages:skinname-vector','s:6:\"Vector\";'),('en','messages:vector-skin-desc','s:74:\"Modern version of MonoBook with fresh look and many usability improvements\";'),('en','messages:vector.css','s:58:\"/* CSS placed here will affect users of the Vector skin */\";'),('en','messages:vector.js','s:72:\"/* Any JavaScript here will be loaded for users using the Vector skin */\";'),('en','messages:vector-action-addsection','s:9:\"Add topic\";'),('en','messages:vector-action-delete','s:6:\"Delete\";'),('en','messages:vector-action-move','s:4:\"Move\";'),('en','messages:vector-action-protect','s:7:\"Protect\";'),('en','messages:vector-action-undelete','s:8:\"Undelete\";'),('en','messages:vector-action-unprotect','s:17:\"Change protection\";'),('en','messages:vector-view-create','s:6:\"Create\";'),('en','messages:vector-view-edit','s:4:\"Edit\";'),('en','messages:vector-view-history','s:12:\"View history\";'),('en','messages:vector-view-view','s:4:\"Read\";'),('en','messages:vector-view-viewsource','s:11:\"View source\";'),('en','messages:vector-more-actions','